INSERT INTO `req_specs_revisions` VALUES ('737', '738', '1', 'PP-0002', '悬窗拖动记忆功能', '<p>1.退出重启记忆</p>\r\n\r\n<p>2.杀进程记忆</p>\r\n\r\n<p>3.停留5s记忆</p>\r\n\r\n<p>4.不退出插件，重启电脑记忆</p>\r\n\r\n<p>5.升级后位置记忆</p>', '0', '1', '1', '已创建需求规范', '7', '2018-07-30 02:22:30', null, '2018-07-30 17:22:30');
INSERT INTO `req_specs_revisions` VALUES ('9573', '9574', '1', 'PP-0003', '公版支持A6语音下发需求', '<p>客户端：1.sound文件夹打包需要下发的语音文件</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; 2.待下发语音文件命名规范：wel_xx.wav，如wel_pp.wav</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; 3.语音下发时机：客户端启动时，下发成功后，更新sound文件夹（删除wel_pp.wav文件）</p>\r\n\r\n<p>支持的固件：A6-1.0.20的升级版本（型号待定）</p>\r\n\r\n<p>&nbsp;</p>', '0', '1', '2', '已创建需求规范', '7', '2018-08-30 19:55:49', '7', '2018-09-20 22:26:08');
