INSERT INTO `tcsteps` VALUES ('93', '1', '<p>1.新增服务商页填入：</p>\r\n\r\n<p>服务商名称：壹</p>\r\n\r\n<p>服务商简称：t</p>\r\n\r\n<p>服务商用户名：t</p>\r\n\r\n<p>角色：服务商（无开发）</p>\r\n\r\n<p>登录密码：123456</p>\r\n\r\n<p>联系人：1</p>\r\n\r\n<p>电话：00000000</p>\r\n\r\n<p>邮箱：1@100.cn</p>\r\n\r\n<p>地址：1</p>\r\n\r\n<p>销售员：sadmin</p>\r\n\r\n<p>2.点击保存</p>\r\n', '<p>1. 提示&ldquo;新增服务商信息成功&rdquo;</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('96', '1', '<p>1.服务商名称框输入&ldquo;test_测试服务商查询&rdquo;</p>\r\n\r\n<p>2.销售员选&ldquo;sadmin&rdquo;</p>\r\n\r\n<p>3.点击查询按钮</p>\r\n', '<p>1. 查询结果中：list count 值为1</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('99', '1', '<p>1. 点击服务商详情按钮</p>\r\n', '<p>1. 服务商名称label: 服务商名称:</p>\r\n\r\n<p>2. 服务商简称label: 服务商简称:</p>\r\n\r\n<p>3. 服务商密钥label: 服务商密钥:</p>\r\n\r\n<p>4. 服务商用户名label: 服务商用户名:</p>\r\n\r\n<p>5. 角色label: 角色:</p>\r\n\r\n<p>6. 登录密码label: 登录密码:</p>\r\n\r\n<p>7. 联系人label: 联系人:</p>\r\n\r\n<p>8. 电话label: 电话:</p>\r\n\r\n<p>9. 邮箱label: 邮箱:</p>\r\n\r\n<p>10. 地址label: 地址:</p>\r\n\r\n<p>11. 销售员label: 销售员:</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('102', '1', '<p>1. 进入服务商管理页面</p>\r\n\r\n<p>2. 搜索要修改的服务商</p>\r\n\r\n<p>3. 点击修改按钮进入修改服务商页填入：</p>\r\n\r\n<p>服务商名称：&#39;服务商_name@$&#39;*20</p>\r\n\r\n<p>服务商简称：&#39;服务商_name@$&#39;*10</p>\r\n\r\n<p>服务商用户名：username_for_service</p>\r\n\r\n<p>角色：服务商（无开发）</p>\r\n\r\n<p>登录密码：20个数字</p>\r\n\r\n<p>联系人：&#39;联系人12&#39;*4</p>\r\n\r\n<p>电话：&#39;12&#39;*10</p>\r\n\r\n<p>邮箱：test_test_test_12@test_100.com</p>\r\n\r\n<p>地址：&#39;中e1@_&#39;*10</p>\r\n\r\n<p>销售员：sadmin</p>\r\n\r\n<p>4. 点击保存</p>\r\n', '<p>1. 提示修改服务商信息成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('105', '1', '<p>1. 进入服务商管理页面</p>\r\n\r\n<p>2. 搜索&ldquo;test_测试服务商删除&rdquo;</p>\r\n\r\n<p>3. 点击删除按钮</p>\r\n\r\n<p>4. 点击确定按钮</p>\r\n', '<p>1. 提示&ldquo;删除服务商信息成功&rdquo;(因元素出现时间不确定，这个断言暂时手动查看)</p>\r\n\r\n<p>2. 当前页面中list count 为0</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('119', '1', '<p>1. 无开发服务商inspos登录设备管理平台</p>\r\n\r\n<p>2. 切换至商户管理平台</p>\r\n', '<p>1. 设备管理平台登录用户名为：inspos</p>\r\n\r\n<p>2. 登录后当前页标题：我的设备</p>\r\n\r\n<p>3. 切换至商户管理平台后，登录用户名为：inspos</p>\r\n\r\n<p>4. 登录后当前页标题：商户管理</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('120', '1', '<p>1. admin用户修改inspos服务商信息</p>\r\n\r\n<p>2. 无开发服务商inspos登录设备管理平台</p>\r\n\r\n<p>3. 切换至商户管理平台</p>\r\n', '<p>1. 设备管理平台登录用户名为：inspos</p>\r\n\r\n<p>2. 登录后当前页标题：我的设备</p>\r\n\r\n<p>3. 切换至商户管理平台后，登录用户名为：inspos</p>\r\n\r\n<p>4. 登录后当前页标题：商户管理</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('121', '1', '<p>1. 有开发服务商inspos2登录设备管理平台</p>\r\n', '<p>1. 设备管理平台登录用户名为：inspos2</p>\r\n\r\n<p>2. 登录后当前页标题：我的设备</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('124', '1', '<p>1. 点击设备管理，进入未销售列表</p>\r\n\r\n<p>2. 在设备输入框中输入要查询的设备号，点击查询按钮</p>\r\n\r\n<p>3. 点击产品类型下拉列表，选择Inspos系列</p>\r\n\r\n<p>4. 点击设备类型下拉列表，选择加强版</p>\r\n', '<p>1. 通过设备号查询，结果唯一，查询数据正确</p>\r\n\r\n<p>2. 筛选数据中不包含Inspos系列之外的产品</p>\r\n\r\n<p>3. 筛选数据中不包含加强版之外的设备</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('127', '1', '<p>1. 进入未销售设备页</p>\r\n\r\n<p>2. 选择要销售的设备</p>\r\n\r\n<p>3. 点销售按钮</p>\r\n\r\n<p>4. 点击服务商下拉列表，选择服务商</p>\r\n\r\n<p>5. 点击确定按钮</p>\r\n', '<p>1. 提示&ldquo;设备已成功销售！&rdquo;</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('130', '1', '<p>1. 进入未销售设备页</p>\r\n\r\n<p>2. 点击批量销售按钮</p>\r\n\r\n<p>3. 选择批量销售文件，点击打开按钮</p>\r\n\r\n<p>4. 点击服务商下拉列表，选择服务商</p>\r\n\r\n<p>5. 点击确定按钮</p>\r\n', '<p>1. 提示1&ldquo;成功销售15台&rdquo;</p>\r\n\r\n<p>2. 提示2&ldquo;未成功销售0台&rdquo;</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('133', '1', '<p>1. 进入我的设备列表页</p>\r\n\r\n<p>2. 每页条数选择&ldquo;100&rdquo;</p>\r\n\r\n<p>3. 点击下一页</p>\r\n\r\n<p>4. 在页码定位框中输入最大页码数，点击确定</p>\r\n', '<p>1. 每页条数选择100时，总页数等于（list count/100）+ 1</p>\r\n\r\n<p>2. 点击下一页后，第一行第一列的设备号与翻页前的不一致</p>\r\n\r\n<p>3. 通过页码定位框定位至最后一页，第一行第一列的设备号与定位前的不一致</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('136', '1', '<p>设备号查询</p>\r\n\r\n<p>1. 进入我的设备页</p>\r\n\r\n<p>2. 输入要查询的设备号</p>\r\n\r\n<p>3. 点击查询</p>\r\n', '<p>1. 设备号查询时，list count值为1</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('139', '1', '<p>1. 进入我的设备页</p>\r\n\r\n<p>2. 点击解绑按钮</p>\r\n\r\n<p>3. 选择批量解绑文件</p>\r\n\r\n<p>4. 点击一键解绑按钮</p>\r\n', '<p>1. 点击一键解绑按钮，提示批量解绑成功</p>\r\n\r\n<p>2. 我的设备中查询批量解绑中的一个设备，list count值为空</p>\r\n\r\n<p>3. 未销售列表中查询批量解绑中的一个设备，list count值为1</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('142', '1', '<p>1. 进入我的设备页</p>\r\n\r\n<p>2. 搜索要解绑的设备</p>\r\n\r\n<p>3. 选择搜索到的设备，点击解绑按钮</p>\r\n\r\n<p>4. 点击取消按钮</p>\r\n\r\n<p>5. 点击解绑按钮</p>\r\n\r\n<p>6. 点击确认按钮</p>\r\n', '<p>1. 点击一键解绑按钮，提示设备解绑成功</p>\r\n\r\n<p>2. 我的设备中查询解绑的设备，list count值为空</p>\r\n\r\n<p>3. 未销售列表中查询解绑的设备，list count值为1</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('145', '1', '<p>1. 销售一批设备给测试账户</p>\r\n\r\n<p>2. 进入我的设备页</p>\r\n\r\n<p>3. 查询第一步中销售的设备，选择该设备</p>\r\n\r\n<p>4. 点击保修期设置按钮，通过日历设置保修天数为0（接口实现）</p>\r\n\r\n<p>5. 选择第4步中设置的设备，点击保修期设置按钮</p>\r\n\r\n<p>6. 保修期与延保期分别输入1，点击保存按钮</p>\r\n\r\n<p>7. 查找第4步中的设备，点击保修期天数，在弹出设置页中保修期输入1，延保期输入0，点击保存按钮</p>\r\n', '<p>1. 起始保修天数为：364</p>\r\n\r\n<p>2. 修改后的保修天数为：0</p>\r\n\r\n<p>3. 提示&ldquo;保修期设置成功&rdquo;</p>\r\n\r\n<p>4. 设置后的保修天数为：729</p>\r\n\r\n<p>5. 设置后的保修天数为：364</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('148', '1', '<p>1. 销售15台设备给测试账户，将设备号保存在&ldquo;批量设置保修期.xls&rdquo;表中</p>\r\n\r\n<p>2. 进入我的设备页，点击保修期设置按钮</p>\r\n\r\n<p>3. 选择批量文件&ldquo;批量设置保修期.xls&rdquo;</p>\r\n\r\n<p>4. 在保修期与延保期输入框中分别输入1</p>\r\n\r\n<p>5. 点击保存按钮</p>\r\n\r\n<p>6. 分别查询两个设备的保修期是否为两年</p>\r\n', '<p>1. 点击保存按钮后，提示&ldquo;保修期批量设置成功&rdquo;</p>\r\n\r\n<p>2. 两次查询结果中，设备对应的保修天数为：729</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('151', '1', '<p>1. 进入我的设备页</p>\r\n\r\n<p>2. 查找要操作的设置</p>\r\n\r\n<p>3. 点击设备详情刷新图标</p>\r\n\r\n<p>4. 点击详情图标后进入设备详情页</p>\r\n\r\n<p>5. 返回设备列表</p>\r\n\r\n<p>6. 点击设备号，进入设备详情</p>\r\n', '<p>1. 点击设备详情刷新图标后提示&ldquo;刷新状态成功&rdquo;</p>\r\n\r\n<p>2. 详情页中的设备为查询时输入的设备，time时间为当前时间戳</p>\r\n\r\n<p>3. 返回设备列表后依旧显示查询结果</p>\r\n\r\n<p>4. 设备版本信息显示区域包括: [&#39;设备编号:&#39;, &#39;销售日期:&#39;, &#39;激活日期:&#39;, &#39;保修期:&#39;, &#39;延保期:&#39;]</p>\r\n\r\n<p>5. 设备版本信息显示区域包括: [&#39;app&#39;, &#39;kernel&#39;, &#39;rootfs&#39;, &#39;uboot&#39;]</p>\r\n\r\n<p>6. 设备连接历史列表包括:当前时间戳</p>\r\n\r\n<p>7. 位置信息显示区域包括: [&#39;设备所在地址&#39;, &#39; IP地址&#39;]</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('154', '1', '<p>1. 进入未销售列表页</p>\r\n\r\n<p>2. 每页条数选择&ldquo;100&rdquo;</p>\r\n\r\n<p>3. 点击下一页</p>\r\n\r\n<p>4. 在页码定位框中输入最大页码数，点击确定</p>\r\n', '<p>1. 每页条数选择100时，总页数等于（list count/100）+ 1</p>\r\n\r\n<p>2. 点击下一页后，第一行第一列的设备号与翻页前的不一致</p>\r\n\r\n<p>3. 通过页码定位框定位至最后一页，第一行第一列的设备号与定位前的不一致</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('157', '1', '<p>1. 创建一个无开发能力服务商并销售15台设备</p>\r\n\r\n<p>2. 用第一步创建的服务商账户登录SP平台</p>\r\n\r\n<p>3. 点击设备管理，点击已销售设备</p>\r\n', '<p>1. list count值为：15</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('160', '1', '<p>1. 进入升级包管理页</p>\r\n\r\n<p>2. 软件类型选择&ldquo;客户端&rdquo;、版本类型选择&ldquo;闪票小盒&rdquo;</p>\r\n\r\n<p>3. 软件类型选择&ldquo;固件&rdquo;、版本类型选择&ldquo;A5-System&rdquo;、更新类型选择&ldquo;自然更新&rdquo;、状态选择&ldquo;已发布&rdquo;</p>\r\n\r\n<p>4. 升级包名称输入框中输入&ldquo;A5公版&rdquo;、版本号输入框中输入&ldquo;4.0.35.1&rdquo;，点击查询按钮</p>\r\n', '<p>1. 选择客户端、闪票小盒时，查询结果中不包含：&#39;固件&#39;, &#39;键盘&#39;, &#39;BasePay&#39;, &#39;A5-System&#39;</p>\r\n\r\n<p>2. 选择固件、A5-System、自然更新、已发布，查询结果中不包含：&#39;客户端&#39;, &#39;键盘&#39;, &#39;BasePay&#39;, &#39;闪票小盒&#39;, &#39;A5 kernel&#39;, &#39;A5 立扫6210&#39;, &#39;强制更新&#39;, &#39;循环升级&#39;, &#39;未发布&#39;</p>\r\n\r\n<p>3. 查询&ldquo;A5公版&rdquo;、&ldquo;4.0.35.1&rdquo;，查询结果：</p>\r\n\r\n<p>1）list count值为1</p>\r\n\r\n<p>2）软件类型为&ldquo;固件&rdquo;</p>\r\n\r\n<p>3）版本类型: A5-System</p>\r\n\r\n<p>4）版本号: 4.0.35.1</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('163', '1', '<p>1. 点设备管理标签--&gt;升级包管理标签--&gt;新建升级按钮</p>\r\n\r\n<p>2. 点返回按钮</p>\r\n\r\n<p>3. 点击新建升级按钮</p>\r\n\r\n<p>4. 升级包类型选择固件</p>\r\n\r\n<p>5. 升级包名称输入&ldquo;测试_固件_test1&rdquo;</p>\r\n\r\n<p>6. 版本类型选择&ldquo;A5-System&rdquo;</p>\r\n\r\n<p>7. 版本号输入&ldquo;200.36.36.33&rdquo;</p>\r\n\r\n<p>8. 更新类型选择&ldquo;自然升级&rdquo;</p>\r\n\r\n<p>9. 所属服务商选择&ldquo;北京意锐新创科技有限公司&rdquo;</p>\r\n\r\n<p>10. 选择上传文件test.ppm</p>\r\n\r\n<p>11. 更新日志输入&ldquo;测试 _*_ 0.0&rdquo;</p>\r\n\r\n<p>12. 点击保存按钮</p>\r\n\r\n<p>13. 软件类型选择固件、版本号输入200.36.36.33，点击查询</p>\r\n', '<p>1. 点击返回按钮，页面返回值升级包管理页</p>\r\n\r\n<p>2. 点击保存按钮，提示&ldquo;新增升级包成功&rdquo;</p>\r\n\r\n<p>3. 查询结果：list count值为1</p>\r\n', '1', '1');
INSERT INTO `tcsteps` VALUES ('164', '2', '<p>1. 点设备管理标签--&gt;升级包管理标签--&gt;新建升级按钮</p>\r\n\r\n<p>2. 升级包名称输入&ldquo;测试_固件_test2&rdquo;</p>\r\n\r\n<p>3. 版本类型选择&ldquo;A5-System&rdquo;</p>\r\n\r\n<p>4. 版本号输入&ldquo;200.36.36.34&rdquo;</p>\r\n\r\n<p>5. 更新类型选择&ldquo;强制升级&rdquo;</p>\r\n\r\n<p>6. 所属服务商选择&ldquo;北京意锐新创科技有限公司&rdquo;</p>\r\n\r\n<p>7. 选择上传文件test.exe</p>\r\n\r\n<p>8. 更新日志输入&ldquo;测试 _*_ 0.0&rdquo;</p>\r\n\r\n<p>9. 点击保存按钮</p>\r\n\r\n<p>10. 软件类型选择固件、版本号输入200.36.36.34，点击查询</p>\r\n', '<p>1. 点击保存按钮，提示&ldquo;新增升级包成功&rdquo;</p>\r\n\r\n<p>2. 查询结果：list count值为1；更新类型为：强制更新</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('169', '1', '<p>1. 进入升级包管理页</p>\r\n\r\n<p>2. 通过升级包名称与版本号查询升级包</p>\r\n\r\n<p>3. 点击详情图标</p>\r\n', '<p>1. 升级包详情页信息包括：&#39;升级包类型&#39;, &#39;升级包名称&#39;, &#39;版本类型&#39;, &#39;版本号&#39;, &#39;更新类型&#39;, &#39;所属服务商&#39;, &#39;发布状态&#39;, &#39;升级包下载&#39;, &#39;更新日志&#39;</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('172', '1', '<p>1. 点击设备管理--&gt;升级包管理</p>\r\n\r\n<p>2. 查询要修改的升级包</p>\r\n\r\n<p>3. 点击修改图标进入修改界面</p>\r\n\r\n<p>4. 点击返回</p>\r\n\r\n<p>5. 点击修改图标进入修改界面</p>\r\n\r\n<p>6. 升级包名称输入框中输入&ldquo;测试_固件_test1_111&rdquo;</p>\r\n\r\n<p>7. 版本类型选择&ldquo;A1 公交&rdquo;</p>\r\n\r\n<p>8. 版本号输入框输入&ldquo;200.36.36.352&rdquo;</p>\r\n\r\n<p>9. 更新类型选择&ldquo;循环升级&rdquo;</p>\r\n\r\n<p>10. 所属服务商选择&ldquo;北京汇元网科技股份有限公司&rdquo;</p>\r\n\r\n<p>11. 发布状态选择&rdquo;已发布&ldquo;</p>\r\n\r\n<p>12. 更新日志输入&ldquo;测试_modify&rdquo;</p>\r\n\r\n<p>13. 点击保存按钮</p>\r\n', '<p>1. 点击返回按钮，返回升级包管理界面</p>\r\n\r\n<p>2. 点击保存按钮，提示&ldquo;修改升级包信息成功&rdquo;</p>\r\n\r\n<p>3. 发布状态为：已发布</p>\r\n\r\n<p>4. 更新类型为：循环升级</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('175', '1', '<p>1. 点设备管理标签--&gt;升级包管理标签--&gt;新建升级按钮</p>\r\n\r\n<p>2. 升级包类型选择客户端</p>\r\n\r\n<p>3. 升级包名称输入&ldquo;测试_客户端_test1&rdquo;</p>\r\n\r\n<p>4. 选择所属服务商&ldquo;北京意锐新创科技有限公司&rdquo;</p>\r\n\r\n<p>5. 选择版本类型&ldquo;BasePay&rdquo;</p>\r\n\r\n<p>6. 版本号输入&ldquo;100.36.36.23&rdquo;</p>\r\n\r\n<p>7. 更新类型选择&ldquo;自然升级&rdquo;</p>\r\n\r\n<p>8. 选择发布状态&ldquo;未发布&rdquo;</p>\r\n\r\n<p>9. 选择上传文件test.ppm</p>\r\n\r\n<p>10. 更新日志输入&ldquo;测试客户端升级，上传升级包类型为.ppm&rdquo;</p>\r\n\r\n<p>11. 点击保存按钮</p>\r\n\r\n<p>12. 软件升级包名称输入&ldquo;测试_客户端_test1&rdquo;，点击查询</p>\r\n', '<p>1. 点击保存按钮，提示&ldquo;新增升级包成功&rdquo;</p>\r\n\r\n<p>2. 查询结果：list count值为1</p>\r\n', '1', '1');
INSERT INTO `tcsteps` VALUES ('176', '2', '<p>1. 点设备管理标签--&gt;升级包管理标签--&gt;新建升级按钮</p>\r\n\r\n<p>2. 升级包类型选择客户端</p>\r\n\r\n<p>3. 升级包名称输入&ldquo;测试_客户端_test2&rdquo;</p>\r\n\r\n<p>4. 选择所属服务商&ldquo;北京意锐新创科技有限公司&rdquo;</p>\r\n\r\n<p>5. 选择版本类型&ldquo;BasePay&rdquo;</p>\r\n\r\n<p>6. 版本号输入&ldquo;100.36.36.24&rdquo;</p>\r\n\r\n<p>7. 更新类型选择&ldquo;强制升级&rdquo;</p>\r\n\r\n<p>8. 选择发布状态&ldquo;未发布&rdquo;</p>\r\n\r\n<p>9. 选择上传文件test.exe</p>\r\n\r\n<p>10. 更新日志输入&ldquo;测试客户端升级，上传升级包类型为.exe&rdquo;</p>\r\n\r\n<p>11. 点击保存按钮</p>\r\n\r\n<p>12. 软件升级包名称输入&ldquo;测试_客户端_test2&rdquo;，点击查询</p>\r\n', '<p>1. 点击保存按钮，提示&ldquo;新增升级包成功&rdquo;</p>\r\n\r\n<p>2. 查询结果：list count值为1；更新类型为：强制更新</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('180', '1', '<p>1. 点设备管理标签--&gt;升级包管理标签--&gt;新建升级按钮</p>\r\n\r\n<p>2. 升级包类型选择键盘</p>\r\n\r\n<p>3. 升级包名称输入&ldquo;测试_键盘_test1&rdquo;</p>\r\n\r\n<p>4. 选择所属服务商&ldquo;北京意锐新创科技有限公司&rdquo;</p>\r\n\r\n<p>5. 选择版本类型&ldquo;KBL-P04&rdquo;</p>\r\n\r\n<p>6. 版本号输入&ldquo;300.36.36.13&rdquo;</p>\r\n\r\n<p>7. 更新类型选择&ldquo;自然升级&rdquo;</p>\r\n\r\n<p>8. 选择发布状态&ldquo;未发布&rdquo;</p>\r\n\r\n<p>9. 选择上传文件test.ppm</p>\r\n\r\n<p>10. 更新日志输入&ldquo;测试键盘升级，上传升级包类型为.ppm&rdquo;</p>\r\n\r\n<p>11. 点击保存按钮</p>\r\n\r\n<p>12. 软件升级包名称输入&ldquo;测试_键盘_test1&rdquo;，点击查询</p>\r\n', '<p>1. 点击保存按钮，提示&ldquo;新增升级包成功&rdquo;</p>\r\n\r\n<p>2. 查询结果：list count值为1</p>\r\n', '1', '1');
INSERT INTO `tcsteps` VALUES ('181', '2', '<p>1. 点设备管理标签--&gt;升级包管理标签--&gt;新建升级按钮</p>\r\n\r\n<p>2. 升级包类型选择键盘</p>\r\n\r\n<p>3. 升级包名称输入&ldquo;测试_键盘_test2&rdquo;</p>\r\n\r\n<p>4. 选择所属服务商&ldquo;北京意锐新创科技有限公司&rdquo;</p>\r\n\r\n<p>5. 选择版本类型&ldquo;KBL-P04&rdquo;</p>\r\n\r\n<p>6. 版本号输入&ldquo;300.36.36.14&rdquo;</p>\r\n\r\n<p>7. 更新类型选择&ldquo;强制升级&rdquo;</p>\r\n\r\n<p>8. 选择发布状态&ldquo;未发布&rdquo;</p>\r\n\r\n<p>9. 选择上传文件test.bin</p>\r\n\r\n<p>10. 更新日志输入&ldquo;测试键盘升级，上传升级包类型为.bin&rdquo;</p>\r\n\r\n<p>11. 点击保存按钮</p>\r\n\r\n<p>12. 软件升级包名称输入&ldquo;测试_键盘_test2&rdquo;，点击查询</p>\r\n', '<p>1. 点击保存按钮，提示&ldquo;新增升级包成功&rdquo;</p>\r\n\r\n<p>2. 查询结果：list count值为1；更新类型为：强制更新</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('182', '3', '<p>1. 点设备管理标签--&gt;升级包管理标签--&gt;新建升级按钮</p>\r\n\r\n<p>2. 升级包名称输入&ldquo;测试_固件_test3&rdquo;</p>\r\n\r\n<p>3. 版本类型选择&ldquo;A5-System&rdquo;</p>\r\n\r\n<p>4. 版本号输入&ldquo;200.36.36.35&rdquo;</p>\r\n\r\n<p>5. 更新类型选择&ldquo;循环升级&rdquo;</p>\r\n\r\n<p>6. 所属服务商选择&ldquo;北京意锐新创科技有限公司&rdquo;</p>\r\n\r\n<p>7. 选择上传文件test.bin</p>\r\n\r\n<p>8. 更新日志输入&ldquo;测试 _*_ 0.0&rdquo;</p>\r\n\r\n<p>9. 点击保存按钮</p>\r\n\r\n<p>10. 软件类型选择固件、版本号输入200.36.36.35，点击查询</p>\r\n', '<p>1. 点击保存按钮，提示&ldquo;新增升级包成功&rdquo;</p>\r\n\r\n<p>2. 查询结果：list count值为1；更新类型为：循环升级</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('185', '1', '<p>1. 进入升级包管理页</p>\r\n\r\n<p>2. 查询要下载的升级包</p>\r\n\r\n<p>3. 点击下载升级包图标</p>\r\n', '<p>1. 下载图标对应的超链接为&ldquo;http://inspiry-product.oss-cn-beijing.aliyuncs.com/firmware/包名&rdquo;</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('188', '1', '<p>1. 进入升级包管理页</p>\r\n\r\n<p>2. 查询&ldquo;测试_固件_test1&rdquo;升级包</p>\r\n\r\n<p>3. 点击删除图标</p>\r\n\r\n<p>4. 点击取消按钮</p>\r\n\r\n<p>5. 点击删除图标, 点击确定按钮</p>\r\n', '<p>1. 点击确定按钮后提示：删除成功</p>\r\n\r\n<p>2. 返回设备管理后的查询结果：查询不到数据！</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('191', '1', '<p>1. 进入升级包管理页</p>\r\n\r\n<p>2. 每页条数选择&ldquo;10&rdquo;</p>\r\n\r\n<p>3. 点击下一页</p>\r\n\r\n<p>4. 在页码定位框中输入最大页码数，点击确定</p>\r\n', '<p>1. 每页条数选择10时，总页数等于（list count/10）+ 1</p>\r\n\r\n<p>2. 点击下一页后，第1行第4列的版本号与翻页前的不一致</p>\r\n\r\n<p>3. 通过页码定位框定位至最后一页，第1行第4列的版本号与定位前的不一致</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('194', '1', '<p>1. 点击设备管理--&gt;设备升级</p>\r\n\r\n<p>2. 服务商选择&ldquo;测试账户&rdquo;</p>\r\n\r\n<p>3. 连接状态选择&ldquo;已连接&rdquo;</p>\r\n\r\n<p>4. 设备编号输入&ldquo;4113180400130999&rdquo;</p>\r\n\r\n<p>5. 点击查询按钮</p>\r\n', '<p>1. 服务商选择&ldquo;测试账户&rdquo;、连接状态选择&ldquo;已连接&rdquo;后，查询结果中不包括&ldquo;未连接&rdquo;及测试账户之外的服务商</p>\r\n\r\n<p>2. 点击查询按钮后，list count值为1</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('197', '1', '<p>1. 进入设备升级页</p>\r\n\r\n<p>2. 选择服务商&ldquo;测试账户&rdquo;</p>\r\n\r\n<p>3. 在设备号输入框中输入&ldquo;44111608000052BA&rdquo;，点击查询按钮</p>\r\n\r\n<p>4. 点击复选框选中设备，点击设备升级按钮</p>\r\n\r\n<p>5. 点击取消按钮</p>\r\n\r\n<p>6. 点击设备升级按钮</p>\r\n\r\n<p>7. 选择BasePayDDB软件，版本号选择1.4.13</p>\r\n\r\n<p>8. 点击确认升级按钮，点击确认窗口中的取消按钮</p>\r\n\r\n<p>9. 点击确认升级按钮，点击确认窗口中的确定按钮</p>\r\n\r\n<p>10. 点击推送升级时间下拉框点击自定义</p>\r\n\r\n<p>11. 选择当前日期后点击确定按钮</p>\r\n', '<p>1. 点击确认升级按钮，点击确认窗口中的确定按钮后提示：升级指令已下发到您指定的1台设备。</p>\r\n\r\n<p>2. 推送升级时间选择当前日期，查询结果中包含设备：44111608000052BA</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('200', '1', '<p>1. 进入设备升级页</p>\r\n\r\n<p>2. 选择服务商&ldquo;测试账户&rdquo;</p>\r\n\r\n<p>3. 点击设备升级按钮</p>\r\n\r\n<p>4. 点击浏览，选择上传批量文件</p>\r\n\r\n<p>5. 点击设备导入按钮</p>\r\n\r\n<p>6. 点击下一步</p>\r\n\r\n<p>7. 选择&ldquo;BasePayDDB&rdquo;软件、版本号选择1.4.13</p>\r\n\r\n<p>8. 点击确认升级按钮</p>\r\n\r\n<p>9. 点击确定按钮</p>\r\n', '<p>1. 点击设备导入后，导入结果显示区域包含: &#39;成功导入：1台&#39;, &#39;未成功导入：1台&#39;, &#39;以下均为未成功设备号：&#39;</p>\r\n\r\n<p>2. 点击确认按钮后，提示消息：升级指令已下发到您指定的1台设备。</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('203', '1', '<p>1. 进入设备升级页</p>\r\n\r\n<p>2. 选择服务商&ldquo;测试账户&rdquo;</p>\r\n\r\n<p>3. 在设备号输入框中输入&ldquo;4113180400130999&rdquo;，点击查询按钮</p>\r\n\r\n<p>4. 点击复选框选中设备，点击固件升级按钮</p>\r\n\r\n<p>5. 点击取消按钮</p>\r\n\r\n<p>6. 点击固件升级按钮</p>\r\n\r\n<p>7. 点击取消按钮</p>\r\n\r\n<p>8. 点击固件升级按钮，版本类型选择A5-System，查询版本4.0.38.4，并选择</p>\r\n\r\n<p>9. 点击确认升级按钮，点击确认窗口中的确定按钮</p>\r\n\r\n<p>10. 点击推送升级时间下拉框点击自定义</p>\r\n\r\n<p>11. 选择当前日期后点击确定按钮</p>\r\n', '<p>1. 点击确认升级按钮，点击确认窗口中的确定按钮后提示：升级指令已下发到您指定的1台设备。</p>\r\n\r\n<p>2. 推送升级时间选择当前日期，查询结果中包含设备：4113180400130999</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('206', '1', '<p>1. 进入设备升级页</p>\r\n\r\n<p>2. 选择服务商&ldquo;测试账户&rdquo;</p>\r\n\r\n<p>3. 点击固件升级按钮</p>\r\n\r\n<p>4. 点击浏览，选择上传批量文件</p>\r\n\r\n<p>5. 点击设备导入按钮</p>\r\n\r\n<p>6. 点击下一步</p>\r\n\r\n<p>7. 查询4.0.38.2固件版本，并选择</p>\r\n\r\n<p>8. 点击确认升级按钮</p>\r\n\r\n<p>9. 点击确定按钮</p>\r\n', '<p>1. 点击设备导入后，导入结果显示区域包含: &#39;成功导入：1台&#39;, &#39;未成功导入：1台&#39;, &#39;以下均为未成功设备号：&#39;</p>\r\n\r\n<p>2. 点击确认按钮后，提示消息：升级指令已下发到您指定的1台设备。</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('209', '1', '<p>1. 进入设备升级页</p>\r\n\r\n<p>2. 选择服务商&ldquo;测试账户&rdquo;</p>\r\n\r\n<p>3. 在设备号输入框中输入&ldquo;44111608000052BA&rdquo;，点击查询按钮</p>\r\n\r\n<p>4. 点击复选框选中设备，点击客户端升级按钮</p>\r\n\r\n<p>5. 点击取消按钮</p>\r\n\r\n<p>6. 点击客户端升级按钮</p>\r\n\r\n<p>7. 选择版本类型：BasePay；输入版本号：2.0.20，点击查询按钮</p>\r\n\r\n<p>8. 选择复选框，点击确认升级按钮</p>\r\n\r\n<p>9. 点击取消按钮</p>\r\n\r\n<p>10. 点击确认升级按钮</p>\r\n', '<p>1. 点击确认升级按钮，点击确认窗口中的确定按钮后提示：升级指令已下发到您指定的1台设备。</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('212', '1', '<p>1. 进入设备升级页</p>\r\n\r\n<p>2. 每页条数选择&ldquo;100&rdquo;</p>\r\n\r\n<p>3. 点击下一页</p>\r\n\r\n<p>4. 在页码定位框中输入最大页码数，点击确定</p>\r\n', '<p>1. 每页条数选择100时，总页数等于（list count/100）+ 1</p>\r\n\r\n<p>2. 点击下一页后，第1行设备号与翻页前的不一致</p>\r\n\r\n<p>3. 通过页码定位框定位至最后一页，第1行设备号与定位前的不一致</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('222', '1', '<p>进入配置界面</p>\r\n\r\n<p>输入带空格或tab的URL</p>\r\n', '<p>url输入框显示空格或tab，程序中过滤空格和tab</p>\r\n', '1', '1');
INSERT INTO `tcsteps` VALUES ('225', '1', '<p>URL全配置</p>\r\n\r\n<p>&nbsp;</p>\r\n', '<p>可配置</p>\r\n', '1', '1');
INSERT INTO `tcsteps` VALUES ('226', '2', '<p>安装启动客户端，查看各功能模块与配置是否一致</p>\r\n', '<p>配置项完整有效</p>\r\n', '1', '1');
INSERT INTO `tcsteps` VALUES ('229', '1', '<p>查看悬窗退款菜单项</p>\r\n', '<p>无</p>\r\n', '1', '1');
INSERT INTO `tcsteps` VALUES ('230', '2', '<p>查看快捷方式是否存在退款快捷设置</p>\r\n', '<p>不存在</p>\r\n', '1', '1');
INSERT INTO `tcsteps` VALUES ('231', '3', '<p>查看右键菜单项是否有退款菜单项</p>\r\n', '<p>无</p>\r\n', '1', '1');
INSERT INTO `tcsteps` VALUES ('232', '4', '<p>交易记录界面是否有退款按钮</p>\r\n', '<p>无</p>\r\n', '1', '1');
