INSERT INTO `tcsteps` VALUES ('237', '1', '<p>配置工具中不配置账单查询URL，查看客户端账单查询相关功能模块是否显示，如:菜单无交接班/交易汇总/交易记录查询</p>\r\n', '<p>无相关模块</p>\r\n', '1', '1');
