INSERT INTO `tcsteps` VALUES ('576', '1', '<p>通过服务商名称查询（模糊查询）</p>\r\n\r\n<p>1. 进入参数配置页</p>\r\n\r\n<p>2. 服务商名称输入框输入&ldquo;测试账户&rdquo;</p>\r\n\r\n<p>3. 点击查询按钮</p>\r\n', '<p>1. 查询结果为包含&ldquo;测试账户&rdquo;字符服务商的参数配置</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('577', '2', '<p>通过参数配置名称查询（模糊查询）</p>\r\n\r\n<p>1. 清除服务商名称输入框中的内容</p>\r\n\r\n<p>2. 在参数配置名称输入框中输入&ldquo;fengziqi&rdquo;</p>\r\n\r\n<p>3. 点击查询按钮</p>\r\n', '<p>查询结果：</p>\r\n\r\n<p>1. 查询结果中包含&ldquo;fengziqi、测试账户&rdquo;</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('578', '3', '<p>通过设备编号查询</p>\r\n\r\n<p>1. 设备编号输入框中输入设备号</p>\r\n\r\n<p>2. 点击查询按钮</p>\r\n', '<p>查询结果：</p>\r\n\r\n<p>1. 查询结果中的服务商信息应为&ldquo;测试账户&rdquo;</p>\r\n\r\n<p>2. list count值为1</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('579', '4', '<p>通过类型查询</p>\r\n\r\n<p>1. 类型下拉列表中选择&ldquo;定额通道&rdquo;</p>\r\n', '<p>1. 查询结果中不能包含&ldquo;普通通道&rdquo;</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('580', '5', '<p>通过是否为默认通过查询</p>\r\n\r\n<p>1. 是否默认下拉列表中选择&ldquo;是&rdquo;</p>\r\n', '<p>1. 查询结果中不能包含&ldquo;否&rdquo;</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('583', '1', '<p>1. 进入参数配置页</p>\r\n\r\n<p>2. 点击添加按钮</p>\r\n\r\n<p>3. 点击返回按钮</p>\r\n', '<p>1. 点击返回按钮，页面跳转至参数配置页</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('584', '2', '<p>1. 点击添加按钮</p>\r\n\r\n<p>2. 填写配置名称&ldquo;selenium_测试0&rdquo;</p>\r\n\r\n<p>3. 选择服务商&ldquo;selenium_test&rdquo;</p>\r\n\r\n<p>4. 是否默认，选择&ldquo;否&rdquo;</p>\r\n\r\n<p>5. 输入密钥&ldquo;123456&rdquo;</p>\r\n\r\n<p>6. 类型选择&ldquo;定额通道&rdquo;</p>\r\n\r\n<p>7. 订单查询链接输入&ldquo;http://testing.testing.com/testing&rdquo;</p>\r\n\r\n<p>8. 订单退款链接输入&ldquo;https://testing.testing.com/testing&rdquo;</p>\r\n\r\n<p>9. 订单撤销链接输入&ldquo;https://testing.testing.com/testing&rdquo;</p>\r\n\r\n<p>10. 账单查询链接输入&ldquo;http://testing.testing.com/testing&rdquo;</p>\r\n\r\n<p>11. 卡券核销链接输入&ldquo;https://testing.testing.com/testing&rdquo;</p>\r\n\r\n<p>12. 被扫链接输入&ldquo;https://testing.testing.com/testing&rdquo;</p>\r\n\r\n<p>13. 主扫链接输入&ldquo;https://testing.testing.com/testing&rdquo;</p>\r\n\r\n<p>14. 请输入超时时间输入&ldquo;30&rdquo;</p>\r\n\r\n<p>15. 点击保存按钮</p>\r\n\r\n<p>16. 参数配置名称输入&ldquo;selenium_测试0&rdquo;，点击查询</p>\r\n', '<p>1. 点击保存按钮，提示&ldquo;新增参数配置信息成功&rdquo;</p>\r\n\r\n<p>2. 查询结果中包含&ldquo;selenium_测试0, selenium_test&rdquo;</p>\r\n', '1', '1');
INSERT INTO `tcsteps` VALUES ('585', '3', '<p>1. 点击添加按钮</p>\r\n\r\n<p>2. 填写配置名称&ldquo;selenium_测试1&rdquo;</p>\r\n\r\n<p>3. 选择服务商&ldquo;selenium_test&rdquo;</p>\r\n\r\n<p>4. 输入密钥&ldquo;123456&rdquo;</p>\r\n\r\n<p>5. 点击保存按钮</p>\r\n\r\n<p>6. 参数配置名称输入&ldquo;selenium_测试1&rdquo;，点击查询</p>\r\n', '<p>1. 点击保存按钮，提示&ldquo;新增参数配置信息成功&rdquo;</p>\r\n\r\n<p>2. 查询结果中包含&ldquo;selenium_测试1, selenium_test&rdquo;</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('587', '4', '<p>1. 点击添加按钮</p>\r\n\r\n<p>2. 填写配置名称&ldquo;selenium_测试2&rdquo;</p>\r\n\r\n<p>3. 选择服务商&ldquo;selenium_test&rdquo;</p>\r\n\r\n<p>4. 是否默认，选择&ldquo;否&rdquo;</p>\r\n\r\n<p>5. 输入密钥&ldquo;123456&rdquo;</p>\r\n\r\n<p>6. 类型选择&ldquo;定额通道&rdquo;</p>\r\n\r\n<p>7. 订单查询链接输入&ldquo;http://testing.testing.com/testing&rdquo;</p>\r\n\r\n<p>8. 订单退款链接输入&ldquo;https://testing.testing.com/testing&rdquo;</p>\r\n\r\n<p>9. 订单撤销链接输入&ldquo;https://testing.testing.com/testing&rdquo;</p>\r\n\r\n<p>10. 账单查询链接输入&ldquo;http://testing.testing.com/testing&rdquo;</p>\r\n\r\n<p>11. 卡券核销链接输入&ldquo;https://testing.testing.com/testing&rdquo;</p>\r\n\r\n<p>12. 被扫链接输入&ldquo;https://testing.testing.com/testing&rdquo;</p>\r\n\r\n<p>13. 主扫链接输入&ldquo;https://testing.testing.com/testing&rdquo;</p>\r\n\r\n<p>14. 请输入超时时间输入&ldquo;30&rdquo;</p>\r\n\r\n<p>15. 点击保存按钮</p>\r\n\r\n<p>16. 参数配置名称输入&ldquo;selenium_测试2&rdquo;，点击查询</p>\r\n', '<p>1. 点击保存按钮，提示&ldquo;新增参数配置信息成功&rdquo;</p>\r\n\r\n<p>2. 查询结果中包含&ldquo;selenium_测试2, selenium_test&rdquo;</p>\r\n', '1', '1');
INSERT INTO `tcsteps` VALUES ('590', '1', '<p>1. 进入参数配置页</p>\r\n\r\n<p>2. 点详情图标</p>\r\n', '<p>1. 参数配置详情页中应包含：</p>\r\n\r\n<p>&#39;配置名称&#39;, &#39;</p>\r\n\r\n<p>服务商&#39;,</p>\r\n\r\n<p>&#39;是否默认&#39;,</p>\r\n\r\n<p>&#39;类型&#39;,</p>\r\n\r\n<p>&#39;密钥&#39;,</p>\r\n\r\n<p>&#39;订单查询链接&#39;,</p>\r\n\r\n<p>&#39;订单退款链接&#39;,</p>\r\n\r\n<p>&#39;订单撤销链接&#39;,&nbsp;</p>\r\n\r\n<p>&#39;账单查询链接&#39;,</p>\r\n\r\n<p>&#39;卡券核销链接&#39;,</p>\r\n\r\n<p>&#39;刷卡支付(被扫)链接&#39;,</p>\r\n\r\n<p>&#39;统一下单(主扫)链接&#39;,</p>\r\n\r\n<p>&#39;请输入超时时间(s)&#39;</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('593', '1', '<p>1. 进入参数配置页</p>\r\n\r\n<p>2. 点击第一行参数配置的修改图标</p>\r\n\r\n<p>3. 点击返回按钮</p>\r\n', '<p>1. 返回参数配置界面</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('594', '2', '<p>1. 查询要修改的参数配置</p>\r\n\r\n<p>2. 点击修改图标</p>\r\n\r\n<p>3. 点击保存按钮</p>\r\n', '<p>1. 提示：修改参数配置信息成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('597', '1', '<p>单台设备下发</p>\r\n\r\n<p>1. 进入参数配置页，查询操作的参数配置</p>\r\n\r\n<p>2. 点击下发设备列表图标</p>\r\n\r\n<p>3. 在参数配置设备下发列表页中搜索设备号</p>\r\n\r\n<p>4. 选择搜索到的设备，点击确认下发按钮，点击确认</p>\r\n', '<p>1. 提示：设备下发成功</p>\r\n\r\n<p>2. 操作触发生成的log中包括[&#39;PayChannelHandler&#39;, &#39;msg={&quot;channelId&quot;:&#39;]</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('599', '2', '<p>通过文件批量下发</p>\r\n\r\n<p>1. 在参数配置设备下发列表页中，点击批量下发按钮</p>\r\n\r\n<p>2. 选择批量文件&ldquo;参数配置批量下发测试.xls&rdquo;</p>\r\n\r\n<p>3. 点击导入按钮，再点击设备下发按钮</p>\r\n\r\n<p>4. 点击确认按钮</p>\r\n', '<p>1. 点击导入按钮后导入结果显示区域：&#39;成功导入：15台&#39;, &#39;未成功导入：0台&#39;</p>\r\n\r\n<p>2. 点击确认按钮后提示：设备下发成功</p>\r\n\r\n<p>3. 操作触发生成的log中包括[&#39;PayChannelHandler&#39;, &#39;msg={&quot;channelId&quot;:&#39;]</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('601', '3', '<p>通过号段批量下发</p>\r\n\r\n<p>1. 在参数配置设备下发列表页中，点击批量下发按钮</p>\r\n\r\n<p>2. 在左边号段输入框输入号段起始设备号：4113180400130999，右边输入4113180400131002</p>\r\n\r\n<p>3. 点击导入，再点击设备下发按钮</p>\r\n\r\n<p>4. 点击确认按钮</p>\r\n\r\n<p>5. 点击导入按钮，再点击设备下发按钮</p>\r\n\r\n<p>6. 点击确认按钮</p>\r\n', '<p>1. 点击导入按钮后导入结果显示区域：&#39;成功导入：1台&#39;, &#39;未成功导入：2台&#39;</p>\r\n\r\n<p>2. 点击确认按钮后提示：设备下发成功</p>\r\n\r\n<p>3. 操作触发生成的log中包括[&#39;PayChannelHandler&#39;, &#39;msg={&quot;channelId&quot;:&#39;]</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('604', '1', '<p>通过服务商名称查询（模糊查询）</p>\r\n\r\n<p>1. 进入金额抓取通用配置页</p>\r\n\r\n<p>2. 服务商名称输入框输入&ldquo;测试账户&rdquo;</p>\r\n\r\n<p>3. 点击查询按钮</p>\r\n', '<p>查询结果：</p>\r\n\r\n<p>1.查询结果中包含&ldquo;测试账户&rdquo;服务商的金额抓取通用配置</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('605', '2', '<p>通过配置名称查询（模糊查询）</p>\r\n\r\n<p>1. 清除服务商名称输入框中的内容</p>\r\n\r\n<p>2. 在配置名称输入框中输入&ldquo;fengziqi&rdquo;</p>\r\n\r\n<p>3. 点击查询按钮</p>\r\n', '<p>查询结果：</p>\r\n\r\n<p>1. list count值为1</p>\r\n\r\n<p>2. 查询结果中包含&ldquo;fengziqi、测试账户&rdquo;</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('608', '1', '<p>绑定单台设备</p>\r\n\r\n<p>1. 进入参数配置页，查询要绑定的参数配置</p>\r\n\r\n<p>2. 点击解绑设备列表图标进入参数配置设备解绑列表</p>\r\n\r\n<p>3. 点击设备绑定按钮</p>\r\n\r\n<p>4. 查询要绑定的设备</p>\r\n\r\n<p>5. 选定设备，点击确认绑定按钮，再点击提示框中的确定按钮</p>\r\n\r\n<p>3. 在参数配置设备下发列表页中搜索设备号</p>\r\n\r\n<p>4. 选择搜索到的设备，点击确认下发按钮，点击确认</p>\r\n', '<p>1. 提示：设备绑定成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('609', '2', '<p>解绑单台设备</p>\r\n\r\n<p>1. 在参数配置设备解绑列表查询要解绑的设备</p>\r\n\r\n<p>2. 选定查询到的设备，点击确认解绑按钮，再点击提示框中的确定按钮</p>\r\n', '<p>1. 提示：设备解绑成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('610', '3', '<p>通过文件批量绑定</p>\r\n\r\n<p>1. 进入参数配置设备解绑列表</p>\r\n\r\n<p>2. 点击设备绑定按钮，进入参数配置设备绑定列表页</p>\r\n\r\n<p>3. 点击批量绑定按钮</p>\r\n\r\n<p>4. 选择批量绑定文件&ldquo;参数配置批量绑定解绑测试.xls&rdquo;</p>\r\n\r\n<p>5. 点击导入</p>\r\n\r\n<p>6. 点击确认绑定，再点击提示框中的确定按钮</p>\r\n\r\n<p>7. 点击导入按钮，再点击设备下发按钮</p>\r\n\r\n<p>8. 点击确认按钮</p>\r\n', '<p>1. 点击导入按钮后导入结果显示区域：&#39;成功导入：15台&#39;, &#39;未成功导入：0台&#39;</p>\r\n\r\n<p>2. 点击确认按钮后提示：设备下发成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('611', '4', '<p>通过文件批量解绑</p>\r\n\r\n<p>1. 在参数配置设备解绑列表点击批量解绑按钮</p>\r\n\r\n<p>2. 选择批量解绑文件&ldquo;参数配置批量绑定解绑测试.xls&rdquo;</p>\r\n\r\n<p>3. 点击导入</p>\r\n\r\n<p>4. 点击确认解绑图标</p>\r\n\r\n<p>5. 点击确认按钮</p>\r\n', '<p>1. 点击导入按钮后导入结果显示区域：&#39;成功导入：15台&#39;, &#39;未成功导入：0台&#39;</p>\r\n\r\n<p>2. 点击确认按钮后提示：设备下发成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('614', '1', '<p>删除默认的参数配置</p>\r\n\r\n<p>1. 进入参数配置页</p>\r\n\r\n<p>2. 通过参数配置名称查询要删除的参数配置</p>\r\n\r\n<p>3. 点击删除图标，点击确认按钮</p>\r\n', '<p>1. 提示消息: 删除参数配置成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('615', '2', '<p>删除非默认的参数配置</p>\r\n\r\n<p>1. 在参数配置名称输入框中输入selenium_test0</p>\r\n\r\n<p>2. 点击删除图标，点击确认按钮</p>\r\n', '<p>1. 提示消息: 删除参数配置成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('616', '3', '<p>删除有绑定设备的非默认参数配置</p>\r\n\r\n<p>1. 在参数配置名称输入框中输入selenium_test0</p>\r\n\r\n<p>2. 点击删除图标，点击确认按钮</p>\r\n', '<p>提示消息: 当前参数配置存在绑定设备，不可删除</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('619', '1', '<p>1. 进入金额抓取通用配置页</p>\r\n\r\n<p>2. 点击添加按钮</p>\r\n\r\n<p>3. 点击返回按钮</p>\r\n', '<p>1. 界面返回至金额抓取通用配置页</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('620', '2', '<p>1. 在金额抓取通用配置页点击添加按钮</p>\r\n\r\n<p>2. 服务商选择：测试账户</p>\r\n\r\n<p>3. 配置名称输入框: selenium_test_sum</p>\r\n\r\n<p>4. 金额识别关键字输入框: 总金额,total</p>\r\n\r\n<p>5. 排除关键字输入框: 退款, refund</p>\r\n\r\n<p>6. 日志上传开关: 开</p>\r\n\r\n<p>7. 票据上传开关: 开</p>\r\n\r\n<p>8. 点击保存按钮</p>\r\n', '<p>1. 提示消息: 新增金额抓取通用配置信息成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('621', '3', '<p>1. 在金额抓取通用配置页点击添加按钮</p>\r\n\r\n<p>2. 服务商选择：测试账户</p>\r\n\r\n<p>3. 配置名称输入框: selenium_test_sum</p>\r\n\r\n<p>4. 金额识别关键字输入框: 总金额,total</p>\r\n\r\n<p>5. 排除关键字输入框: 退款, refund</p>\r\n\r\n<p>6. 点击保存按钮</p>\r\n', '<p>1. 提示消息: 配置名称已经存在</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('624', '1', '<p>1. 进入参数配置页</p>\r\n\r\n<p>2. 点详情图标</p>\r\n', '<p>1. 参数配置详情页中应包含：</p>\r\n\r\n<p>&#39;服务商名称&#39;,</p>\r\n\r\n<p>&#39;配置名称&#39;,</p>\r\n\r\n<p>&#39;金额识别关键字&#39;,</p>\r\n\r\n<p>&#39;排除关键字&#39;,</p>\r\n\r\n<p>&#39;日志上传开关&#39;,</p>\r\n\r\n<p>&#39;票据上传开关&#39;</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('627', '1', '<p>单个设备下发</p>\r\n\r\n<p>1. 进入金额抓取通用配置页</p>\r\n\r\n<p>2. 查询要下发的金额抓取通用配置</p>\r\n\r\n<p>3. 点击下发图标，进入下发页面</p>\r\n\r\n<p>4. 设备编号输入框输入：4113180400130999，点击查询按钮</p>\r\n\r\n<p>5. 选择设备，点击确认下发按钮，点击确定按钮</p>\r\n', '<p>1. 提示消息: 设备下发成功</p>\r\n\r\n<p>2. 操作触发生成的log中包括[&#39;DeviceConfigHandler&#39;, &#39;msg=[{&quot;deviceId&quot;:&#39;]</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('628', '2', '<p>1. 点击下发图标, 进入下发页面</p>\r\n\r\n<p>2. 点击批量下发按钮</p>\r\n\r\n<p>3. 起始/结束号段分别输入：4113180400130997与4113180400130999</p>\r\n\r\n<p>4. 点击导入按钮</p>\r\n\r\n<p>5. 点击设备下发按钮，点击确定按钮</p>\r\n', '<p>1. 点击导入按钮后，导入成功的设备数量应大于0，小于等于3（各个环境同批次设备绑定情况不定）</p>\r\n\r\n<p>2. 提示消息: 设备下发成功</p>\r\n\r\n<p>3. 操作触发生成的log中包括[&#39;DeviceConfigHandler&#39;, &#39;msg=[{&quot;deviceId&quot;:&#39;]</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('629', '3', '<p>1. 点击下发图标，进入下发页面</p>\r\n\r\n<p>2. 点击批量下发按钮</p>\r\n\r\n<p>3. 选择批量文件&ldquo;金额抓取通用配置批量下发.xls&rdquo;</p>\r\n\r\n<p>4. 点击导入按钮</p>\r\n\r\n<p>5. 点击设备下发按钮，点击确定按钮</p>\r\n', '<p>1. 导入结果显示区域包含: [&#39;成功导入：1台&#39;, &#39;未成功导入：2台&#39;, &#39;test&#39;, &#39;124434235123153432212123&#39;]</p>\r\n\r\n<p>2. 提示消息: 设备下发成功</p>\r\n\r\n<p>3. 操作触发生成的log中包括[&#39;DeviceConfigHandler&#39;, &#39;msg=[{&quot;deviceId&quot;:&#39;]</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('632', '1', '<p>1. 进入金额抓取通用配置页</p>\r\n\r\n<p>2. 查询要修改的配置&ldquo;selenium_测试_sum&rdquo;</p>\r\n\r\n<p>3. 点击修改图标进入修改页面</p>\r\n\r\n<p>4. 配置名称输入框: selenium_测试_sum</p>\r\n\r\n<p>5. 金额识别关键字输入框: 总金额,total</p>\r\n\r\n<p>6. 排除关键字输入框: 退款, refund</p>\r\n\r\n<p>7. 日志上传开关: 关</p>\r\n\r\n<p>8. 票据上传开关: 关</p>\r\n\r\n<p>9. 点击保存按钮</p>\r\n', '<p>1. 提示消息: 修改金额抓取通用配置信息成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('633', '2', '<p>1. 查询&ldquo;selenium_测试_sum&rdquo;，点击修改图标进入修改页面</p>\r\n\r\n<p>2. 配置名称输入框输入：测试_fengziqi</p>\r\n\r\n<p>3. 点击保存按钮</p>\r\n', '<p>1. 提示消息: 配置名称已经存在</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('636', '1', '<p>1. 进入金额抓取通用配置页</p>\r\n\r\n<p>2. 配置名称输入框输入：selenium_test_sum，查询</p>\r\n\r\n<p>3. 点击删除图标，点击确定按钮</p>\r\n', '<p>1. 提示消息: 删除金额抓取通用配置成功！</p>\r\n\r\n<p>2. 查询的list count: 0</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('639', '1', '<p>1. 进入金额抓取独立配置页</p>\r\n\r\n<p>2. 点击新增按钮</p>\r\n\r\n<p>3. 点击确认按钮</p>\r\n', '<p>不选择设备，点击确认按钮: 请先选择要新增的设备</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('640', '2', '<p>1. 在新增列表页查询&ldquo;4113180400130999&rdquo;</p>\r\n\r\n<p>2. 选定设备，点击确认按钮</p>\r\n\r\n<p>3. 金额识别关键字输入框: 总金额,total</p>\r\n\r\n<p>4. 排除关键字输入框: 退款, refund</p>\r\n\r\n<p>5. 日志上传开关：开</p>\r\n\r\n<p>6. 票据上传开关：开</p>\r\n\r\n<p>7. 点击保存按钮</p>\r\n', '<p>提示消息: 添加成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('643', '1', '<p>1. 进入金额抓取独立配置页</p>\r\n\r\n<p>2. 设备编号输入框输入：4113180400130999，点击查询</p>\r\n', '<p>查询结果：</p>\r\n\r\n<p>1. list count值为1</p>\r\n\r\n<p>2. 结果中包含：&#39;4113180400130999&#39;</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('646', '1', '<p>1. 进入金额抓取独立配置页</p>\r\n\r\n<p>2. 查询设备&ldquo;4113180400130999&rdquo;</p>\r\n\r\n<p>3. 点击详情图标，进入详情页面</p>\r\n', '<p>1. 详情页中应包括：&#39;设备号&#39;, &#39;金额识别关键字&#39;, &#39;排除关键字&#39;, &#39;日志上传开关&#39;, &#39;票据上传开关&#39;</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('649', '1', '<p>1. 进入金额抓取独立配置页</p>\r\n\r\n<p>2. 点击修改图标</p>\r\n\r\n<p>3. 在金额抓取独立配置修改页点击返回按钮</p>\r\n', '<p>1. 页面返回金额抓取独立配置页</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('650', '2', '<p>1. 在金额抓取独立配置页查询设备&ldquo;4113180400130999&rdquo;</p>\r\n\r\n<p>2. 点击修改图标进入修改页面</p>\r\n\r\n<p>3. 金额识别关键字输入框: 总金额,total</p>\r\n\r\n<p>4. 排除关键字输入框: 退款, refund</p>\r\n\r\n<p>5. 点击保存按钮</p>\r\n', '<p>提示消息: 修改成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('653', '1', '<p>1. 进入金额抓取独立配置页，查询设备&ldquo;4113180400130999&rdquo;</p>\r\n\r\n<p>2. 点击配置下发图标</p>\r\n\r\n<p>3. 点击确定按钮</p>\r\n', '<p>1. 提示消息: 配置下发成功</p>\r\n\r\n<p>2. 操作触发生成的log中包括[&#39;DeviceConfigHandler&#39;, &#39;msg=[{&quot;deviceId&quot;:&#39;]</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('656', '1', '<p>1. 进入金额抓取独立配置页</p>\r\n\r\n<p>2. 查询设备&ldquo;4113180400130999&rdquo;</p>\r\n\r\n<p>3. 点击删除图标</p>\r\n\r\n<p>4. 点击确定按钮</p>\r\n', '<p>提示消息: 删除金额抓取单独配置信息成功！</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('659', '1', '<p>1. 进入自定义配置模板页</p>\r\n\r\n<p>2. 点击添加配置模板按钮</p>\r\n\r\n<p>3. 点击返回按钮</p>\r\n', '<p>1. 页面返回至自定义配置模板页</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('660', '2', '<p>1. 点击添加配置模板按钮</p>\r\n\r\n<p>2. 服务商选择：测试账户</p>\r\n\r\n<p>3. 模板名称输入框输入：test_for_测试</p>\r\n\r\n<p>4. 第一行参数简称输入&ldquo;测试1&rdquo;，参数名输入&ldquo;test1&rdquo;</p>\r\n\r\n<p>5. 点击增加字段图标</p>\r\n\r\n<p>6. 第二行参数简称输入&ldquo;测试2&rdquo;，参数名输入&ldquo;test2&rdquo;</p>\r\n\r\n<p>7. 点击保存按钮</p>\r\n', '<p>1. 提示信息：新增自定义通用配置模板信息成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('664', '1', '<p>1. 进入自定义配置模板页</p>\r\n\r\n<p>2. 模板名称输入框输入：selenium_测试自定义配置模板</p>\r\n\r\n<p>3. 点击查询按钮</p>\r\n', '<p>1. 查询结果：list count值为1</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('665', '2', '<p>1. 点击详情图标</p>\r\n', '<p>1. 自定义通用配置模板详情信息包括：&#39;服务商&#39;, &#39;模板名称&#39;, &#39;参数简称&#39;, &#39;参数名&#39;, &#39;操作&#39;</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('668', '1', '<p>修改已有配置</p>\r\n\r\n<p>1. 进入自定义配置模板页</p>\r\n\r\n<p>2. 查询&ldquo;selenium_测试自定义配置模板&rdquo;配置</p>\r\n\r\n<p>3. 点击修改图标，进入修改页面</p>\r\n\r\n<p>4. 模板名称输入框输入：test_modify</p>\r\n\r\n<p>5.<em> </em>点击修改</p>\r\n\r\n<p>6. 修改第一行参数简称输入：修改1，产生名输入：modify1</p>\r\n\r\n<p>7. 点击确认图标</p>\r\n', '<p>1. 提示信息：修改自定义通用配置模板成功</p>\r\n', '1', '1');
INSERT INTO `tcsteps` VALUES ('669', '2', '<p>去掉一条已有配置</p>\r\n\r\n<p>1. 在自定义配置模板修改页点击删掉图标</p>\r\n\r\n<p>2. 点击确定按钮</p>\r\n', '<p>1. 提示信息：删除自定义通用配置模板成功！</p>\r\n', '1', '1');
INSERT INTO `tcsteps` VALUES ('670', '3', '<p>新增一条配置</p>\r\n\r\n<p>1. 在自定义配置模板页点击修改图标</p>\r\n\r\n<p>2. 点击增加字段图标</p>\r\n\r\n<p>3. 在新增的行中参数简称输入&ldquo;测试3&rdquo;，参数名输入&ldquo;test3&rdquo;</p>\r\n\r\n<p>4. 点击保存按钮</p>\r\n', '<p>1. 提示信息：修改自定义通用配置模板信息成功</p>\r\n', '1', '1');
INSERT INTO `tcsteps` VALUES ('673', '1', '<p>1. 进入自定义配置模板页</p>\r\n\r\n<p>2. 查询&ldquo;selenium_测试自定义配置模板&rdquo;</p>\r\n\r\n<p>3. 点击删除图标</p>\r\n\r\n<p>4. 点击确定按钮</p>\r\n', '<p>提示信息：删除自定义通用配置成功</p>\r\n', '1', '1');
INSERT INTO `tcsteps` VALUES ('676', '1', '<p>通过自定义通用配置的名称查询</p>\r\n\r\n<p>1. 进入自定义通用配置页</p>\r\n\r\n<p>2. 配置名称输入框输入：test_通用配置</p>\r\n\r\n<p>3. 点击查询按钮</p>\r\n', '<p>查询结果：list count: 1</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('677', '2', '<p>通过设备编号查询</p>\r\n\r\n<p>1. 在自定义通用配置页的设备编号输入框输入绑定的设备号</p>\r\n\r\n<p>2. 点击查询</p>\r\n', '<p>查询结果：list count：1</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('678', '3', '<p>通过服务商查询</p>\r\n\r\n<p>1. 在自定义通用配置页点击服务商下拉列表</p>\r\n\r\n<p>2. 查询服务商</p>\r\n', '<p>查询结果：list count：1</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('681', '1', '<p>1. 进入自定义通用配置页</p>\r\n\r\n<p>2. 点击添加按钮</p>\r\n\r\n<p>3. 点击返回按钮</p>\r\n', '<p>1. 页面返回至自定义通用配置页</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('682', '2', '<p>1. 在自定义通用配置页点击添加按钮</p>\r\n\r\n<p>2. 服务商选择：test_自定义通用配置</p>\r\n\r\n<p>3. 点击删除图标</p>\r\n', '<p>1. 删除图标不存在</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('683', '3', '<p>1. 在新增自定义配置页配置名称输入框输入：test_自定义通用配置</p>\r\n\r\n<p>2. 服务商选择：test_自定义通用配置</p>\r\n\r\n<p>3. 点击增加字段图标</p>\r\n\r\n<p>4. 第一行参数简称下拉框：选择测试2，参数值输入：参数值1</p>\r\n\r\n<p>5. 点击增加字段图标</p>\r\n\r\n<p>6. 第二行参数简称下拉框：选择测试1，参数值输入：参数值2</p>\r\n\r\n<p>7. 点击保存按钮</p>\r\n', '<p>1. 提示消息: 新增自定义配置信息成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('684', '4', '<p>配置详情查看</p>\r\n\r\n<p>1. 点击详情图标，进入详情页面</p>\r\n', '<p>自定义通用配置详情显示区域: &#39;配置名称&#39;, &#39;服务商&#39;, &#39;参数简称&#39;, &#39;参数值&#39;, &#39;模板名称&#39;</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('687', '1', '<p>1. 进入自定义通用配置页</p>\r\n\r\n<p>2. 点击修改图标</p>\r\n\r\n<p>3. 点击返回按钮</p>\r\n', '<p>1. 页面返回至自定义通用配置页</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('688', '2', '<p>1. 在自定义通用配置页点击修改图标</p>\r\n\r\n<p>2. 点击删除图标</p>\r\n', '<p>1. 删除图标不存在</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('689', '3', '<p>1. 在修改自定义配置页配置名称输入框输入：test_modify</p>\r\n\r\n<p>2. 第一行参数值输入框输入：修改值1</p>\r\n\r\n<p>3. 点击增加字段图标</p>\r\n\r\n<p>4. 第二行参数简称下拉框：选择测试1，参数值输入框输入：修改值2</p>\r\n\r\n<p>5. 点击保存按钮</p>\r\n', '<p>1. 提示消息: 修改自定义配置信息成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('692', '1', '<p>单个设备下发</p>\r\n\r\n<p>1. 进入自定义通用配置页</p>\r\n\r\n<p>2. 查询要下发的自定义通用配置</p>\r\n\r\n<p>3. 点击下发图标，进入下发页面</p>\r\n\r\n<p>4. 设备编号输入框输入：4113180400130999，点击查询按钮</p>\r\n\r\n<p>5. 选择设备，点击确认下发按钮，点击确定按钮</p>\r\n', '<p>1. 提示消息: 设备下发成功</p>\r\n\r\n<p>2. 操作触发生成的log中包括[&#39;ParamListMsgEvent&#39;, &#39;msg={&quot;deviceNoList&quot;:&#39;, &#39;&quot;paramListId&quot;&#39;]</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('694', '2', '<p>1. 点击下发图标，进入下发页面</p>\r\n\r\n<p>2. 点击批量下发按钮</p>\r\n\r\n<p>3. 选择批量文件&ldquo; 自定义通用配置批量下发.xls&rdquo;</p>\r\n\r\n<p>4. 点击导入按钮</p>\r\n\r\n<p>5. 点击设备下发按钮，点击确定按钮</p>\r\n', '<p>1. 导入结果显示区域包含: [&#39;成功导入：1台&#39;, &#39;未成功导入：2台&#39;, &#39;test&#39;, &#39;124434235123153432212123&#39;]</p>\r\n\r\n<p>2. 提示消息: 设备下发成功</p>\r\n\r\n<p>3. 操作触发生成的log中包括[&#39;ParamListMsgEvent&#39;, &#39;msg={&quot;deviceNoList&quot;:&#39;, &#39;&quot;paramListId&quot;&#39;]</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('697', '1', '<p>绑定单台设备</p>\r\n\r\n<p>1. 进入自定义通用配置页，查询要绑定的自定义通用配置</p>\r\n\r\n<p>2. 点击解绑设备列表图标进入自定义通用配置设备解绑列表</p>\r\n\r\n<p>3. 点击设备绑定按钮</p>\r\n\r\n<p>4. 查询要绑定的设备</p>\r\n\r\n<p>5. 选定设备，点击确认绑定按钮，再点击提示框中的确定按钮</p>\r\n\r\n<p>3. 在自定义通用配置设备下发列表页中搜索设备号</p>\r\n\r\n<p>4. 选择搜索到的设备，点击确认下发按钮，点击确认</p>\r\n', '<p>1. 提示：设备绑定成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('698', '2', '<p>解绑单台设备</p>\r\n\r\n<p>1. 在自定义通用配置设备解绑列表查询要解绑的设备</p>\r\n\r\n<p>2. 选定查询到的设备，点击确认解绑按钮，再点击提示框中的确定按钮</p>\r\n', '<p>1. 提示：设备解绑成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('699', '3', '<p>通过文件批量绑定</p>\r\n\r\n<p>1. 进入自定义通用配置设备解绑列表</p>\r\n\r\n<p>2. 点击设备绑定按钮，进入自定义通用配置设备绑定列表页</p>\r\n\r\n<p>3. 点击批量绑定按钮</p>\r\n\r\n<p>4. 选择批量绑定文件&ldquo;自定义通用配置批量绑定解绑测试.xls&rdquo;</p>\r\n\r\n<p>5. 点击导入</p>\r\n\r\n<p>6. 点击确认绑定，再点击提示框中的确定按钮</p>\r\n\r\n<p>7. 点击导入按钮，再点击设备下发按钮</p>\r\n\r\n<p>8. 点击确认按钮</p>\r\n', '<p>1. 点击导入按钮后导入结果显示区域：&#39;成功导入：15台&#39;, &#39;未成功导入：0台&#39;</p>\r\n\r\n<p>2. 点击确认按钮后提示：设备下发成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('700', '4', '<p>通过文件批量解绑</p>\r\n\r\n<p>1. 在自定义通用配置设备解绑列表点击批量解绑按钮</p>\r\n\r\n<p>2. 选择批量解绑文件&ldquo;自定义通用配置批量绑定解绑测试.xls&rdquo;</p>\r\n\r\n<p>3. 点击导入</p>\r\n\r\n<p>4. 点击确认解绑图标</p>\r\n\r\n<p>5. 点击确认按钮</p>\r\n', '<p>1. 点击导入按钮后导入结果显示区域：&#39;成功导入：15台&#39;, &#39;未成功导入：0台&#39;</p>\r\n\r\n<p>2. 点击确认按钮后提示：设备下发成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('703', '1', '<p>1. 进入自定义通用配置页</p>\r\n\r\n<p>2. 配置名称输入框输入：test_通用配置</p>\r\n\r\n<p>3. 点击查询按钮</p>\r\n\r\n<p>4. 点击删除图标</p>\r\n', '<p>提示消息: 删除自定义配置成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('709', '1', '<p>1. 进入自定义独立配置页</p>\r\n\r\n<p>2. 设备编号输入框输入：4113180400130999</p>\r\n\r\n<p>3. 服务商名称输入框输入：测试账户</p>\r\n\r\n<p>4. 点击查询按钮</p>\r\n', '<p>1. 进入自定义独立配置页后没有(错误)提示消息</p>\r\n\r\n<p>2. 通过设备号及服务商查询时没有(错误)提示消息</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('712', '1', '<p>通过服务商查询</p>\r\n\r\n<p>1. 进入自定义批量配置页</p>\r\n\r\n<p>2. 服务商选择：测试账户</p>\r\n', '<p>1. 查询结果列表包括: &#39;4113180400130999&#39;, &#39;test_add&#39;</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('713', '2', '<p>通过商户号、设备编号查询</p>\r\n\r\n<p>1. 商户号输入框：test_add</p>\r\n\r\n<p>2. 设备编号输入框：4113180400130999</p>\r\n\r\n<p>3. 点击查询按钮</p>\r\n', '<p>1. 查询结果：list count值为1</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('716', '1', '<p>1. 进入自定义批量配置页</p>\r\n\r\n<p>2. 服务商选择：测试账户</p>\r\n\r\n<p>3. 点击添加按钮</p>\r\n\r\n<p>4. 商户号输入框：测试_add</p>\r\n\r\n<p>5. 设备编号输入框：4113180400130999</p>\r\n\r\n<p>6. 点击导入按钮</p>\r\n\r\n<p>7. 点击保存并下发按钮</p>\r\n', '<p>1. 点击导入按钮后，导入结果显示包括：&#39;成功导入：1台&#39;, &#39;未成功导入：0台&#39;</p>\r\n\r\n<p>2. 点击保存并下发按钮，提示消息：文件保存并下发成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('717', '2', '<p>1. 在自定义批量配置页点击添加按钮</p>\r\n\r\n<p>2. 上传批量文件&ldquo;自定义批量配置批量下发.xls&rdquo;</p>\r\n\r\n<p>3. 点击导入按钮</p>\r\n\r\n<p>4. 点击保存并下发按钮</p>\r\n', '<p>1. 点击导入按钮后，导入结果显示包括：&#39;成功导入：1台&#39;, &#39;未成功导入：2台&#39;, &#39;test&#39;, &#39;124434235123153432212123&#39;</p>\r\n\r\n<p>2. 点击保存并下发按钮，提示消息: 文件保存并下发成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('720', '1', '<p>1. 进入自定义批量配置页</p>\r\n', '<p>自定义批量配置页有&ldquo;模板下载按钮&rdquo;并且有超链接&ldquo;https://inspiry-product.oss-cn-beijing.aliyuncs.com/template/*.xlsx&rdquo;</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('723', '1', '<p>1. 进入自定义批量配置页</p>\r\n\r\n<p>2. 服务商选择：测试账户</p>\r\n\r\n<p>3. 查询设备号&ldquo;4113180400130999&rdquo;</p>\r\n\r\n<p>4. 点击修改图标</p>\r\n\r\n<p>5. 点击提示框中的取消按钮</p>\r\n\r\n<p>6. 点击修改图标</p>\r\n\r\n<p>7. 商户号输入框: 修改_test</p>\r\n\r\n<p>8. 点击保存按钮</p>\r\n', '<p>1. 提示消息: 修改配置商户号成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('728', '1', '<p>1. 进入自定义批量配置页</p>\r\n\r\n<p>2. 服务商选择：测试账户</p>\r\n\r\n<p>3. 查询设备号&ldquo;4113180400130999&rdquo;</p>\r\n\r\n<p>4. 点击下发图标</p>\r\n\r\n<p>5. 点击确定按钮</p>\r\n', '<p>1. 提示消息: 下发配置成功</p>\r\n\r\n<p>2. 操作触发生成的log中包括[&#39;IndependentConfigMsgHandler&#39;, &#39;msg={&quot;deviceNoList&quot;:&#39;, &#39;&quot;paramName&quot;&#39;, &#39;&quot;paramValue&quot;&#39;]</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('731', '1', '<p>1. 进入自定义批量配置页</p>\r\n\r\n<p>2. 服务商选择：测试账户</p>\r\n\r\n<p>3. 查询设备号&ldquo;4113180400130999&rdquo;</p>\r\n\r\n<p>4. 点击删除图标</p>\r\n\r\n<p>5. 点击确定按钮</p>\r\n', '<p>1. 提示消息: 删除设备配置成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('734', '1', '<p>通过服务商查询</p>\r\n\r\n<p>1. 进入票据解析页</p>\r\n\r\n<p>2. 服务商选择：测试账户</p>\r\n', '<p>1. 查询结果列表中不包含&ldquo;测试账户&rdquo;之外的服务商解析配置</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('735', '2', '<p>通过模板名称查询：</p>\r\n\r\n<p>1. 模板名称输入框：测试_fengziqi</p>\r\n\r\n<p>2. 点击查询按钮</p>\r\n', '<p>1. 查询结果：list count值为1</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('736', '3', '<p>通过设备编号查询</p>\r\n\r\n<p>1. 设备编号输入框：4113180400130999</p>\r\n\r\n<p>2. 点击查询按钮</p>\r\n', '<p>1. 查询结果：list count值为1</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('741', '1', '<p>1. 进入票据解析页</p>\r\n\r\n<p>2. 查询：测试票据解析服务商</p>\r\n\r\n<p>3. 点击新增模板按钮</p>\r\n\r\n<p>4. 点击排除关键字删除按钮</p>\r\n', '<p>1. 排除关键字删除按钮不存在</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('742', '2', '<p>1. 点击删除操作图标</p>\r\n', '<p>1. 排除关键字删除按钮不存在</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('743', '3', '<p>1. 在新增票据模板页的模板名称输入框：add_测试</p>\r\n\r\n<p>2. 服务商选择：测试票据解析服务商</p>\r\n\r\n<p>3. 模板描述输入框：这里是描述，description</p>\r\n\r\n<p>4. 通知地址输入框：http://dm4.preo.2dupay.com:8080/customer/notify</p>\r\n\r\n<p>5. 密钥输入框：secret key</p>\r\n\r\n<p>6. 点击3次增加关键字按钮，分别填入排除关键字：排除_word0/1/2</p>\r\n\r\n<p>7. 点击10次增加字段按钮，偶数行的结束类型选择&ldquo;换行&rdquo;、抓取类型选择&ldquo;候选字&rdquo;、提取下一行选&ldquo;是&rdquo;</p>\r\n\r\n<p>8. 关键字：关键字_word0~9、候选字：候选字_word0~9、参数名：参数名_word0~9</p>\r\n\r\n<p>9. 启用安全推送选择&ldquo;禁用&rdquo;后再选择启用</p>\r\n\r\n<p>10. 点击保存按钮</p>\r\n', '<p>1. 提示消息: 添加模板成功</p>\r\n\r\n<p>2. 票据解析页的查询结果：list count值为1</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('744', '4', '<p>详情页</p>\r\n\r\n<p>1. 点击详情图标</p>\r\n', '<p>1. 票据模版详情显示区域包括：</p>\r\n\r\n<p>&#39;模板名称&#39;, &#39;模板描述&#39;, &#39;排除关键字&#39;, &#39;服务商名称&#39;,</p>\r\n\r\n<p>&#39;通知地址&#39;, &#39;密钥&#39;, &#39;结束类型&#39;, &#39;抓取类型&#39;, &#39;关键字&#39;,</p>\r\n\r\n<p>&#39;候选字(逗号分隔)&#39;, &#39;参数名&#39;, &#39;提取下一行&#39;, &#39;删除操作&#39;,</p>\r\n\r\n<p>&#39;是否使用&#39;, &#39;启用安全推送&#39;, &#39;是否存储&#39;, &#39;启用&#39;, &#39;禁用&#39;</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('747', '1', '<p>1. 进入票据解析页</p>\r\n\r\n<p>2. 服务商选择：测试账户</p>\r\n\r\n<p>3. 查询票据解析模板&ldquo;测试_fengziqi&rdquo;</p>\r\n\r\n<p>4. 点击设备列表图标进入绑定解绑页面</p>\r\n\r\n<p>5. 点击添加设备按钮</p>\r\n\r\n<p>6. 查询要绑定的设备</p>\r\n\r\n<p>7. 点击确认添加按钮</p>\r\n', '<p>1. 提示消息: 设备添加成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('748', '2', '<p>1. 在票据解析设备列表页选定要解绑的设备</p>\r\n\r\n<p>2. 点击确定按钮</p>\r\n', '<p>1. 提示消息: 设备解绑成功</p>\r\n\r\n<p>2. 在票据解析设备列表页中的查询结果列表: 该查询条件下暂时没有设备</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('751', '1', '<p>模板未绑定设备时修改</p>\r\n\r\n<p>1. 进入票据解析页</p>\r\n\r\n<p>2. 服务商选择：测试账户</p>\r\n\r\n<p>3. 查询&ldquo;用于修改测试&rdquo;模板</p>\r\n\r\n<p>4. 点击修改图标，进入修改页面</p>\r\n\r\n<p>5. 点击排除关键字删除按钮</p>\r\n\r\n<p>6. 点击删除操作图标</p>\r\n\r\n<p>7. 点击保存按钮</p>\r\n', '<p>提示消息: 修改模板成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('752', '2', '<p>模板绑定设备时修改</p>\r\n\r\n<p>1. 在票据解析页点击修改图标，进入修改页面</p>\r\n\r\n<p>2. 模板名称输入框：modify_测试</p>\r\n\r\n<p>3. 点击增加关键字按钮</p>\r\n\r\n<p>4. 填入排除关键字：排除_word0</p>\r\n\r\n<p>5. 点击增加字段按钮</p>\r\n\r\n<p>6. 关键字_word0、候选字_word0、参数名_word0</p>\r\n\r\n<p>7.&nbsp;点击保存按钮</p>\r\n', '<p>提示消息: 修改模板成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('755', '1', '<p>1. 进入票据解析页</p>\r\n\r\n<p>2. 服务商选择：测试账户</p>\r\n\r\n<p>3. 查询票据配置模板&ldquo;用于删除测试&rdquo;</p>\r\n\r\n<p>4. 点击删除图标</p>\r\n\r\n<p>5. 点击确定按钮</p>\r\n', '<p>1. 提示消息: 删除成功</p>\r\n\r\n<p>2. 查询结果列表: 查询不到数据！</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('758', '1', '<p>通过设备类型查询</p>\r\n\r\n<p>1. 进入票据管理页</p>\r\n\r\n<p>2. 服务商选择：测试账户</p>\r\n\r\n<p>3. 设备类型选择：加强版</p>\r\n', '<p>查询结果列表中不包括：&#39;RC&#39;, &#39;基础版&#39;, &#39;兼容版&#39;, &#39;闪票小盒&#39;, &#39;外设产品&#39;, &#39;公交扫码设备&#39;</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('759', '2', '<p>通过产品类型查询</p>\r\n\r\n<p>1. 在票据管理页设备类型选择：Inspos系列</p>\r\n', '<p>查询结果列表中不包括：&#39;条码扫描设备&#39;, &#39;国际版&#39;, &#39;专销产品&#39;, &#39;配件&#39;</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('760', '3', '<p>通过设备号查询</p>\r\n\r\n<p>1. 在票据管理页设备编号输入：4113180400130999</p>\r\n\r\n<p>2. 点击查询按钮</p>\r\n', '<p>查询结果：list count值为1</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('763', '1', '<p>1. 进入票据管理页</p>\r\n\r\n<p>2. 服务商选择：测试账户</p>\r\n\r\n<p>3. 查询设备&ldquo;4113180400130999&rdquo;</p>\r\n\r\n<p>4. 点击设备编号&quot;4113180400130999&quot;进入票据配置信息页</p>\r\n\r\n<p>5. 点击添加配置按钮</p>\r\n\r\n<p>6. 点击取消按钮</p>\r\n', '<p>1. 点击取消按钮，弹窗退出</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('764', '3', '<p>1. 在票据配置信息页点击添加配置按钮</p>\r\n\r\n<p>2. 点击票据复选框</p>\r\n\r\n<p>3. 点击确定按钮</p>\r\n\r\n<p>4. 点击弹窗中的确定按钮</p>\r\n', '<p>1. 页面中有添加解析区域按钮</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('765', '2', '<p>1. 在票据配置信息页点击删除配置按钮</p>\r\n', '<p>1. 提示消息：清闲选择要删除的票据配置</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('768', '1', '<p>1. 进入全局配置页</p>\r\n\r\n<p>2. 配置名称输入框：全局配置查询测试</p>\r\n\r\n<p>3. 点击查询按钮</p>\r\n', '<p>1. 查询结果：list count值为1</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('769', '2', '<p>1. 点击查看全局配置详情图标，进入详情页面</p>\r\n', '<p>全局配置详情显示区域包括: &#39;配置名称&#39;, &#39;日志上传地址&#39;, &#39;票据上传地址&#39;, &#39;ping地址&#39;</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('772', '1', '<p>1. 进入全局配置页</p>\r\n\r\n<p>2. 点击新增配置按钮</p>\r\n\r\n<p>3. 点击返回按钮</p>\r\n', '<p>1. 页面返回至全局配置页</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('773', '2', '<p>1. 在全局配置页点击新增配置按钮</p>\r\n\r\n<p>2. 配置名称输入框：add_全局配置测试</p>\r\n\r\n<p>3. 日志上传地址输入框：http://test.test.cn.com/test</p>\r\n\r\n<p>4. 票据上传地址输入框：http://test.test.cn.com/test</p>\r\n\r\n<p>5. ping地址输入框：http://test.test.cn.com/test</p>\r\n\r\n<p>6. 点击保存按钮</p>\r\n', '<p>1. 提示消息: 新增全局配置信息成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('776', '1', '<p>1. 进入全局配置页</p>\r\n\r\n<p>2. 查询&ldquo;全局配置修改测试&rdquo;</p>\r\n\r\n<p>3. 点击修改图标</p>\r\n\r\n<p>4. 点击返回按钮</p>\r\n', '<p>1. 页面返回至全局配置页</p>\r\n', '1', '2');
