INSERT INTO `tcsteps` VALUES ('780', '1', '<p>1. 进入全局配置页</p>\r\n\r\n<p>2. 查询全局配置&ldquo;全局配置删除测试&rdquo;</p>\r\n\r\n<p>3. 点击删除图标</p>\r\n\r\n<p>4. 点击确定按钮</p>\r\n', '<p>1. 提示消息: 删除成功</p>\r\n\r\n<p>2. 查询结果列表: 查询不到数据！</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('783', '1', '<p>1. 进入日志配置页</p>\r\n\r\n<p>2. 服务商名称输入框：日志配置查询测试服务商</p>\r\n\r\n<p>3. 点击查询按钮</p>\r\n', '<p>1. 查询结果：list count值为1</p>\r\n', '1', '2');
