INSERT INTO `tcsteps` VALUES ('788', '2', '<p>1. 在日志配置页点击添加日志按钮</p>\r\n\r\n<p>2. 服务商选择：日志配置添加测试服务商</p>\r\n\r\n<p>3. 类型选择：https</p>\r\n\r\n<p>4. 推送地址输入框：http://test.test.cn.com/test/testing</p>\r\n\r\n<p>5. 密钥输入框：密钥_sign_key</p>\r\n\r\n<p>6. 描述输入框：description_描述</p>\r\n\r\n<p>7. 点击保存按钮</p>\r\n', '<p>1. 提示消息: 添加日志配置成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('791', '1', '<p>1. 进入日志配置页</p>\r\n\r\n<p>2. 查询&ldquo;日志配置修改测试服务商&rdquo;服务商</p>\r\n\r\n<p>3. 点击修改图标</p>\r\n\r\n<p>4. 点击返回按钮</p>\r\n', '<p>1. 页面返回至日志配置页</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('792', '2', '<p>1. 在日志配置页点击修改图标</p>\r\n\r\n<p>2. 类型选择：https</p>\r\n\r\n<p>3. 推送地址输入框：http://test.test.cn.com/test/testing</p>\r\n\r\n<p>4. 密钥输入框：密钥_sign_key</p>\r\n\r\n<p>5. 描述输入框：description_描述</p>\r\n\r\n<p>6. 点击保存按钮</p>\r\n', '<p>1. 提示消息: 修改日志配置信息成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('795', '1', '<p>1. 进入日志配置页</p>\r\n\r\n<p>2. 查询&ldquo;日志配置删除测试服务商&rdquo;的日志配置</p>\r\n\r\n<p>3. 点击删除图标</p>\r\n\r\n<p>4. 点击确定按钮</p>\r\n', '<p>1. 提示消息: 删除日志配置成功</p>\r\n\r\n<p>2. 查询结果列表: 查询不到数据！</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('882', '1', '<p>1. 点击系统定制标签</p>\r\n\r\n<p>2. 点击语音场景设置标签</p>\r\n', '<p>1. 语音场景列表中包括：&#39;序号&#39;, &#39;场景名称&#39;, &#39;操作&#39;</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('883', '2', '<p>1. 新增语音场景</p>\r\n', '<p>1. 新增语音场景成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('884', '3', '<p>1. 修改语音场景</p>\r\n', '<p>1. 修改语音场景成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('885', '4', '<p>1. 删除语音场景</p>\r\n', '<p>1. 删除语音场景成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('888', '1', '<p>新增自定义语音模板：</p>\r\n\r\n<p>1. 进入系统定制页</p>\r\n\r\n<p>2. 点击添加语音模板按钮</p>\r\n\r\n<p>3. 语音模板名称输入框：test_语音模板添加</p>\r\n\r\n<p>4. 服务商选择：test_测试语音模板服务商</p>\r\n\r\n<p>5. 选择两条语音场景，分别选择上传的语音文件</p>\r\n\r\n<p>6. 点击保存按钮</p>\r\n', '<p>1. 提示消息: 新增自定义语音模板成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('889', '2', '<p>查询：</p>\r\n\r\n<p>1. 进入系统定制页，在自定义语音模板输入框: test_语音模板添加</p>\r\n\r\n<p>2. 点击查询按钮</p>\r\n', '<p>1. 查询结果：list count值为1</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('890', '3', '<p>详情：</p>\r\n\r\n<p>1. 查询自定义语音模板&ldquo;test_语音模板添加&rdquo;后，点击详情图标</p>\r\n', '<p>自定义语音模板详情显示区域包括: &#39;语音模板名称&#39;, &#39;定制化语音文件上传&#39;, &#39;请选择可定制的语音场景&#39;, &#39;服务商&#39;</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('891', '4', '<p>修改自定义语音模板（去掉一条场景） ：</p>\r\n\r\n<p>1. 查询自定义语音模板&ldquo;test_语音模板添加&rdquo;后，点击修改图标进入修改页</p>\r\n\r\n<p>2. 语音模板名称输入框：test_语音模板添加_modify</p>\r\n\r\n<p>3. 去掉一个场景</p>\r\n\r\n<p>4. 点击保存按钮</p>\r\n', '<p>1. 提示消息: 修改自定义语音模板成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('892', '5', '<p>修改自定义语音模板（增加一条场景）：</p>\r\n\r\n<p>1. 点击修改图标进入修改页</p>\r\n\r\n<p>2. 添加一个场景</p>\r\n\r\n<p>3. 点击保存按钮</p>\r\n', '<p>1. 提示消息: 修改自定义语音模板成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('893', '6', '<p>删除：</p>\r\n\r\n<p>1. 查询要删除的模板，点击删除图标</p>\r\n\r\n<p>2. 点击确定按钮</p>\r\n', '<p>1. 提示消息: 删除自定义语音模板板成功</p>\r\n\r\n<p>2. 查询结果列表: 查询不到数据！</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('896', '1', '<p>添加自定义语音：</p>\r\n\r\n<p>1. 进入自定义语音页</p>\r\n\r\n<p>2. 点击添加定制按钮</p>\r\n\r\n<p>3. 自定义语音名称输入框：test_add自定义语音</p>\r\n\r\n<p>4. 服务商选择：测试账户</p>\r\n\r\n<p>5. 选择一条语音场景，点击播放图标</p>\r\n\r\n<p>6. 点击增加语音图标，点击删除图标</p>\r\n\r\n<p>7. 点击增加语音图标，选择一条语音场景</p>\r\n\r\n<p>8. 点击保存按钮</p>\r\n', '<p>1. 提示消息: 新增自定义语音成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('897', '2', '<p>查询：</p>\r\n\r\n<p>1. 进入系统定制页，在语音名称输入框: test_add自定义语音</p>\r\n\r\n<p>2. 点击查询按钮</p>\r\n', '<p>1. 查询结果：list count值为1</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('898', '3', '<p>详情：</p>\r\n\r\n<p>1. 查询自定义语音&ldquo;test_add自定义语音&rdquo;后，点击详情图标</p>\r\n', '<p>1. 自定义语音详情显示区域包括: &#39;自定义语音名称&#39;, &#39;服务商&#39;, &#39;自定义语音模板&#39;, &#39;情景语音位置&#39;, &#39;语音文件&#39;, &#39;播放&#39;, &#39;操作&#39;</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('899', '4', '<p>修改自定义语音（去掉一条场景） ：</p>\r\n\r\n<p>1. 查询自定义语音模板&ldquo;test_add自定义语音&rdquo;后，点击修改图标进入修改页</p>\r\n\r\n<p>2. 自定义语音名称输入框：test_add自定义语音modify</p>\r\n\r\n<p>3. 去掉一个场景</p>\r\n\r\n<p>4. 点击保存按钮</p>\r\n', '<p>1. 提示消息: 修改语音定制信息成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('900', '5', '<p>修改自定义语音（增加一条场景）：</p>\r\n\r\n<p>1. 点击修改图标进入修改页</p>\r\n\r\n<p>2. 添加一个场景</p>\r\n\r\n<p>3. 点击保存按钮</p>\r\n', '<p>1. 提示消息: 修改语音定制信息成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('901', '11', '<p>删除：</p>\r\n\r\n<p>1. 查询要删除的自定义语音，点击删除图标</p>\r\n\r\n<p>2. 点击确定按钮</p>\r\n', '<p>1. 提示消息: 删除自定义语音成功</p>\r\n\r\n<p>2. 查询结果列表: 查询不到数据！</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('927', '6', '<p>通过平台选择绑定设备</p>\r\n\r\n<p>1.<em> </em>点击解绑设备列表图标，进入设备解绑列表页面</p>\r\n\r\n<p>2. 点击设备绑定按钮</p>\r\n\r\n<p>3. 选择要绑定的设备</p>\r\n\r\n<p>4. 点击确认绑定按钮，点击提示窗中的确定按钮</p>\r\n', '<p>1. 提示消息: 设备绑定成功</p>\r\n', '1', '1');
INSERT INTO `tcsteps` VALUES ('928', '7', '<p>批量绑定设备</p>\r\n\r\n<p>1. 在设备绑定列表页面点击设备绑定按钮</p>\r\n\r\n<p>2. 点击批量绑定按钮</p>\r\n\r\n<p>3. 选择批量文件，点击导入</p>\r\n\r\n<p>4. 点击确认绑定按钮，点击提示窗中的确定按钮</p>\r\n', '<p>1. 点击导入按钮后，导入结果显示区域包括: &#39;成功导入：1台&#39;, &#39;未成功导入：2台&#39;, &#39;test&#39;, &#39;124434235123153432212123&#39;</p>\r\n\r\n<p>2. 点击确定按钮后，提示消息: 设备绑定成功</p>\r\n', '1', '1');
INSERT INTO `tcsteps` VALUES ('929', '8', '<p>下发自定义语音</p>\r\n\r\n<p>1. 点击下发设备列表图标，进入下发页面</p>\r\n\r\n<p>2. 选择下发设备</p>\r\n\r\n<p>3. 点击确认下发按钮，点击提示框中的确定按钮</p>\r\n', '<p>1. 提示消息: 设备下发成功</p>\r\n', '1', '1');
INSERT INTO `tcsteps` VALUES ('930', '9', '<p>通过平台选择解绑设备</p>\r\n\r\n<p>1. 点击解绑设备列表图标，进入设备解绑列表页面</p>\r\n\r\n<p>2. 选择要解绑的设备</p>\r\n\r\n<p>3. 点击确认解绑按钮，点击提示窗中的确定按钮</p>\r\n\r\n<p>&nbsp;</p>\r\n', '<p>1. 提示消息: 设备解绑成功</p>\r\n', '1', '1');
INSERT INTO `tcsteps` VALUES ('931', '10', '<p>批量解绑设备</p>\r\n\r\n<p>1. 点击解绑设备列表图标，进入设备解绑列表页面</p>\r\n\r\n<p>2. 点击批量解绑按钮</p>\r\n\r\n<p>3. 选择批量解绑文件，点击导入按钮</p>\r\n\r\n<p>4. 点击确认绑定按钮，点击提示窗中的确定按钮</p>\r\n', '<p>1. 点击导入按钮后，导入结果显示区域包括: &#39;成功导入：1台&#39;, &#39;未成功导入：2台&#39;, &#39;test&#39;, &#39;124434235123153432212123&#39;</p>\r\n\r\n<p>2. 提示消息: 设备解绑成功</p>\r\n', '1', '1');
INSERT INTO `tcsteps` VALUES ('934', '1', '<p>1. 进入全局配置页</p>\r\n\r\n<p>2. 查询&ldquo;全局配置查询测试&rdquo;</p>\r\n\r\n<p>3. 点击配置下发选择设备图标，进入下发页面</p>\r\n\r\n<p>4. 查询要绑定的设备，并选定</p>\r\n\r\n<p>5. 点击确认下发按钮</p>\r\n', '<p>1. 提示消息: 配置下发成功</p>\r\n\r\n<p>2. 操作触发生成的log中包括[&#39;DeviceCommonConfigHandler&#39;, &#39;msg={&quot;configId&quot;:&#39;]</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('935', '2', '<p>1. 点击配置下发选择设备图标，进入下发页面</p>\r\n\r\n<p>2. 点击批量下发按钮</p>\r\n\r\n<p>3. 选择上传文件，并导入</p>\r\n\r\n<p>4. 点击设备下发按钮，点击弹窗中的确定按钮</p>\r\n', '<p>1. 点击导入后，导入结果显示区域包括: [&#39;成功导入：15台&#39;, &#39;未成功导入：0台&#39;]</p>\r\n\r\n<p>2. 点击弹窗中的确定按钮后，提示消息: 配置下发成功</p>\r\n\r\n<p>3. 操作触发生成的log中包括[&#39;DeviceCommonConfigHandler&#39;, &#39;msg={&quot;configId&quot;:&#39;]</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('940', '1', '<p>1. 进入自定义壁纸页</p>\r\n\r\n<p>2. 查询&ldquo;脚本用勿动__自定义壁纸&rdquo;配置</p>\r\n\r\n<p>3. 点击下发设备列表图标，进入下发页面</p>\r\n\r\n<p>4. 选择要下发的设备</p>\r\n\r\n<p>5. 点击确认下发按钮，点击确定按钮</p>\r\n', '<p>1. 提示消息: 设备下发成功</p>\r\n\r\n<p>2. 操作触发生成的log中包括[&#39;DeviceScanConfigHandler&#39;, &#39;msg={&quot;deviceNoList&quot;:&#39;, &#39;&quot;scanConfigId&quot;&#39;]</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('973', '1', '启动BasePay.exe', '1.基础版盒子点亮，发出{滴}一声蜂鸣，', '1', '1');
