INSERT INTO `tcsteps` VALUES ('977', '5', '点击【开始】', '进入设备激活界面，导航栏的“激活设备”图标高亮显示', '1', '1');
INSERT INTO `tcsteps` VALUES ('980', '1', '1.PC连接有ID基础版盒子，进入客户端激活设备界面', '1.自动读取盒子ID入ID栏，', '1', '1');
