INSERT INTO `tcsteps` VALUES ('3712', '1', '1.通过串口工具发送“INSPIRYVERSION”查看模块软件版本', '1.单片机MCU：V1.0.1 \n   A6固件：V1.0.5', '1', '1');
INSERT INTO `tcsteps` VALUES ('3715', '1', '1.扫恢复出厂设置的二维码', '1.通信：\n   韦根通信协议：34(10位)\n   虚拟串口\n    RS通信协议：485\n2.补光灯：识读周期内亮\n3. 声光提示：\n    提示灯：开\n    识读成功提示灯：开\n    提示音：开\n    识读成功提示音：开\n4. 条码识读模式：默认感应模式\n    识读时长：5s\n    识读间隔：1s\n    相同条码延时：不延时\n    灵敏度：较高\n    自动识读模式：\n    识读时长：5s\n    识读间隔：1s\n    相同条码延时：不延时\n5.条码识读和非接卡识读数据编辑：\n     默认前缀：无前缀\n     默认后缀：回车换行\n     默认正倒序：正序\n6. IC卡：\n    识读开关：开\n    识读卡类型设置 ：身份模式 \n    识读间隔：1s\n', '1', '1');
INSERT INTO `tcsteps` VALUES ('3718', '1', '1.设置自动模式无间隔情况下持续扫码识读', '1.每秒内最多可蜂鸣5次', '1', '1');
INSERT INTO `tcsteps` VALUES ('3722', '1', '<p>1、取A卡在盒子上方进行扫码，识读距离在0~10cm 2、电脑查看串口工具输出码 3、码制转换为10进制，进行对比</p>\r\n', '<p>5次操作后： 1、启动成功，设备启动&ldquo;嘀&rdquo;声长鸣提示，长亮一下，声光时长500ms 2、识读成功，&ldquo;嘀&rdquo;一声提示，闪一下，声光时长50ms 3、输出接口协议正常 4、A卡码识读正确</p>\r\n', '1', '1');
INSERT INTO `tcsteps` VALUES ('3725', '1', '1、取A卡在盒子上方进行扫码，识读距离在0~10cm\n2、电脑查看串口工具输出码\n3、码制转换为10进制，进行对比', '5次操作后：\n1、启动成功，设备启动“嘀”声长鸣提示，长亮一下，声光时长500ms\n2、识读成功，“嘀”一声提示，闪一下，声光时长50ms\n3、输出接口协议正常\n4、A卡码识读正确', '1', '1');
