INSERT INTO `tcsteps` VALUES ('7766', '1', '1、自定义通用配置模板“linda测试自定义模板”，点击修改按钮。\n2、在参数简称“设备属性上传”一行，点击修改按钮，修改按钮变为勾选按钮，修改参数简称为“设备属性上传地址”，点击勾选按钮。', '1.参数简称修改成功，更新dm_inspos库dm_param_template_parameters表\n2.使用该自定义模板的所有自定义通用配置，参数简称下拉框中的名称同步修改为“设备属性上传地址”。更新dm_inspos库dm_param_list_parameters表', '1', '1');
INSERT INTO `tcsteps` VALUES ('7769', '1', '1、自定义通用配置模板“linda测试自定义模板”，参数简称“设备属性上传地址”的参数名为persist.datamodel.url，下发给设备，在我的设备刷新设备详情，查看设备详情。\n2、修改参数简称“设备属性上传地址”的参数名为persist.datamodel.sc.url，且修改参数值为错误的地址。\n3、修改参数“音量”persist.a.volume的值7为8\n4、下发给设备，在我的设备页面刷新设备详情，查看设备详情', '设备详情中参数persist.datamodel.url和值存在，且新增了参数persist.datamodel.sc.url和值，参数“音量”的值生效为8。\n更新 dm_inspos库dm_param_template_parameters表和dm_param_list_parameters表', '1', '1');
