INSERT INTO `tcsteps` VALUES ('7858', '1', '1.选择一自定义通用配置，点击解绑设备按钮；\n2.进入自定义通用配置设备解绑列表，点击设备绑定；\n3.进入自定义通用配置设备绑定列表，选择一设备，点击确认绑定。', '1、设备绑定成功，返回自定义通用配置设备解绑列表。\n2、设备出现在下发列表中。', '1', '1');
INSERT INTO `tcsteps` VALUES ('7861', '1', '1.选择一自定义通用配置，点击解绑设备按钮；\n2.进入自定义通用配置设备解绑列表，选择一设备；\n3.点击确认解绑。', '设备解绑成功，设备不在解绑列表、下发列表中，出现在设备绑定列表中。', '1', '1');
