INSERT INTO `tcsteps` VALUES ('7867', '1', '前提：设备属性上传地址正确\n1.修改参数“音量”persist.a.volume的值6为7\n2.下发给设备，在我的设备页面刷新设备详情，查看设备详情', '下发成功，且生效。设备详情页参数“音量”persist.a.volume的值为7', '1', '1');
INSERT INTO `tcsteps` VALUES ('7868', '2', '1.修改自定义通用配置中的设备属性上传地址为错误地址\n2.修改参数“音量”persist.a.volume的值7为8\n3.下发给设备，在我的设备页面刷新设备详情，查看设备详情', '下发成功，但是没有生效。设备详情页参数“音量”persist.a.volume的值仍为7', '1', '1');
INSERT INTO `tcsteps` VALUES ('7871', '1', '1.选择一自定义通用配置，配置下有设备绑定，点击删除按钮；', '删除失败，提示参数配置使用中，不可删除。', '1', '1');
