INSERT INTO `tcsteps` VALUES ('7875', '1', '选择一自定义通用配置，修改其某项参数如小票打印张数，去掉原有值，设置值为空，保存后下发给设备', '该设备最新配置记录与修改后的自定义通用配置内容一致，其中小票打印张数项整个参数段、参数值均被清除。', '1', '1');
INSERT INTO `tcsteps` VALUES ('7878', '1', '1.设备绑定在服务商a下，下发自定义通用配置（包含设备属性上传地址、卡券核销、撤单、音量等配置项）\n在我的设备刷新设备详情；\n2.设备断开连接，将设备从服务商a下解绑;\n3.打印设备信息', '设备从服务商a下解绑后\n1.dm_device表的字段param_id置为null；\n2.写mangodb自定义配置下发记录（路径dm_admin_logs-->Collections -->dm_inspos_release_record，自定义配置id=设备最后一次下发的自定义配置id）；\n3.打印设备信息中卡券核销、撤单地址的参数值为空', '1', '1');
