INSERT INTO `tcsteps` VALUES ('7908', '1', '1.用户名：1<n<20的混合中、英文、数字、特殊字符；=20的混合中、英文、数字、特殊字符\n2.密码：>6的混合英文、数字、特殊字符，=6的混合英文、数字、特殊字符，6<n<15的混合英文、数字、特殊字符，=15的混合英文、数字、特殊字符', '需求待定', '1', '1');
