INSERT INTO `tcsteps` VALUES ('7917', '1', '以系统管理员角色为例\n1.成功新建角色为系统管理员的用户ghf,打开DM环境地址，输入账号ghf、密码123;\n2.点击登录，描述现象。', '登录DM平台成功。（右上方切换平台入口：DM \\SP\\等，与权限平台赋予系统管理员权限平台数据一致）', '1', '1');
