INSERT INTO `tcsteps` VALUES ('7932', '1', '1.推送地址url位数：<9、=9、>9的混合英文、数字、特殊字符\n2.密钥：>1的混合英文、数字、特殊字符\n3.描述：>1的混合中文、英文、数字、特殊字符', '1.位数<9混合英文、数字、特殊字符，提示url地址最小为9位字符；位数>=9混合英文、数字、特殊字符允许输入\n2.允许输入\n3.允许输入', '1', '1');
INSERT INTO `tcsteps` VALUES ('7935', '1', '1、点击添加按钮进入新增日志配置页面\n2、服务商选择测试账户\n3、推送地址：http://dm4.testing.2dupay.com:8080/customer/notify{测试环境地址，正式环境写服务商的推送地址}\n4、密钥如QA！12345\n5、类型 ：测试环境：http、正式环境：https\n6、填写描述项如：测试账户QA1日志配置模板！，保存', '保存后列表出现新增的日志配置', '1', '1');
