INSERT INTO `tcsteps` VALUES ('7947', '1', '进入DM平台-系统定制-自定义壁纸', '', '1', '1');
INSERT INTO `tcsteps` VALUES ('7950', '1', '1.在“自定义壁纸”页点击“图片裁剪”；\n2.可点击“浏览”，选择图片，进行裁剪；\n3.预览区可见裁剪效果，点击“保存”', '1.裁剪过后，图片成功保存在本地\n2.保存成功后，可继续浏览新图片，进行裁剪', '1', '1');
INSERT INTO `tcsteps` VALUES ('7953', '1', '1.在“自定义壁纸”页点击“添加壁纸”；\n2.填入自定义壁纸名称“测试xyz！”，选择服务商，上传主屏LOGO、广告背景图（至多5张），选择.bmp文件；\n3.点击“保存”', '1.提示“新增自定义壁纸”\n2.页面跳转至“自定义壁纸”页', '1', '1');
INSERT INTO `tcsteps` VALUES ('7956', '1', '1.在“自定义壁纸”页点击“详情”图标；', '1.进入“自定义壁纸详情”页；\n2.显示内容正确', '1', '1');
INSERT INTO `tcsteps` VALUES ('7959', '1', '1.在“自定义壁纸”页点击“修改”图标；\n2.修改名称，选择屏幕背景图片；\n3.点击“保存”', '1.提示“修改自定义壁纸信息成功”页；\n2.保存后，返回“自定义壁纸”页', '1', '1');
INSERT INTO `tcsteps` VALUES ('7962', '1', '1.在“自定义壁纸”页点击“解绑设备列表”图标；\n2.在“设备解绑列表”页点击“设备绑定”；\n3.选择5台设备，点击“确认绑定”', '1.提示“设备绑定成功”；\n2.确认绑定后，返回“设备解绑列表”页', '1', '1');
INSERT INTO `tcsteps` VALUES ('7965', '1', '1.在“设备解绑列表”页选择2台设备；\n2.点击“确认解绑”；\n3.点击“确定”', '1.提示“设备解绑成功”；\n2.页面返回“自定义壁纸”页', '1', '1');
INSERT INTO `tcsteps` VALUES ('7968', '1', '1.在“自定义壁纸”页点击“下发”图标；\n2.在“设备下发列表”选择2台设备，点击“确认下发”；\n3.点击“确定”', '1.提示下发成功；\n2.页面返回“自定义壁纸”页', '1', '1');
INSERT INTO `tcsteps` VALUES ('7971', '1', '1.登录nexus.2dupay.com\n2.go p5\n3.路径 /var/log/2018-03-27/inspos-dm-ppcp2\n4.tail -50f 日志名 | grep “设备编号”', '下发后，日志有更新', '1', '1');
INSERT INTO `tcsteps` VALUES ('7974', '1', '1.在“自定义壁纸定制”页点击“修改”按钮；\n2.修改名称，选择屏幕背景图片；\n3.点击“保存”', '1.提示“修改显示屏信息成功”页；\n2.保存后，返回“显示屏定制”页', '1', '1');
INSERT INTO `tcsteps` VALUES ('7977', '1', '1.在“自定义壁纸定制”页点击“删除”按钮；\n2.点击“确认”', '1.提示“该配置有绑定设备删除失败”', '1', '1');
INSERT INTO `tcsteps` VALUES ('7980', '1', '1.解绑所有设备；\n2.在“自定义壁纸”页点击“删除”按钮；\n3.点击“确认”', '1.提示“删除自定义壁纸成功”', '1', '1');
