INSERT INTO `tcsteps` VALUES ('7986', '4', '再次新建升级，升级包类型选固件升级包，版本类型选A5-System，版本号设为4.0.23，其他信息填写完整，点击保存。', '提示“创建失败，软件版本号冲突”', '1', '1');
INSERT INTO `tcsteps` VALUES ('7989', '1', '升级包类型选固件升级包\n1.查看所属服务商默认值\n2.服务商默认选择意锐新创科技，点击确定按钮\n3.其他信息填写完整，点击保存。', '1.所属服务商默认选择“意锐新创科技”\n2.所属服务商选择框中显示“意锐新创科技”\n3.创建成功，返回升级包管理列表页。查询升级包显示1条记录。', '1', '1');
INSERT INTO `tcsteps` VALUES ('7990', '2', '升级包类型选固件升级包\n1.所属服务商去掉默认“意锐新创科技”勾选\n2.点击确定按钮\n3.其他信息填写完整，点击保存。', '1.所属服务商选项变为“请选择服务商”\n2.所属服务商选择框中显示“请选择服务商”\n3.提示“请选择服务商”', '1', '1');
INSERT INTO `tcsteps` VALUES ('7991', '3', '升级包类型选固件升级包\n1.所属服务商选择20个指定服务商(包含意锐)，点击确定按钮\n2.其他信息填写完整，点击保存。', '1.所属服务商选择框中显示“20个指定服务商(包含意锐)”\n2.创建成功，返回升级包管理列表页。查询升级包显示1条记录。', '1', '1');
INSERT INTO `tcsteps` VALUES ('7992', '4', '升级包类型选固件升级包\n1.所属服务商选择20个指定服务商(不包含意锐)，点击确定按钮\n2.其他信息填写完整，点击保存。', '1.所属服务商选择框中显示“20个指定服务商(不包含意锐)”\n2.创建成功，返回升级包管理列表页。查询升级包显示1条记录。', '1', '1');
INSERT INTO `tcsteps` VALUES ('7995', '1', '所属服务商选择意锐\n任一服务商下的设备进行固件升级，选择版本', '所有服务商可见该版本', '1', '1');
INSERT INTO `tcsteps` VALUES ('7996', '2', '所属服务商选择多个且包含意锐\n任一服务商下的设备进行固件升级，选择版本', '所有服务商可见该版本', '1', '1');
INSERT INTO `tcsteps` VALUES ('7997', '3', '所属服务商选择除意锐之外的服务商\n1.指定服务商下的设备进行固件升级，选择版本\n2.意锐下的设备进行固件升级，选择版本\n3.指定服务商之外的服务商下的设备进行固件升级，选择版本', '1.可见该版本\n2.不可见该版本\n3.不可见该版本', '1', '1');
