INSERT INTO `tcsteps` VALUES ('8197', '1', '1、当天没有上传设备所有信息（没有调用设备所有信息上传接口，且没有刷新设备详情）\n2、选择汇总方式、日期、输入设备号，点击查询', '如果库里没有对应日期的数据，直接写库，默认上行、下行流量均为0', '1', '1');
INSERT INTO `tcsteps` VALUES ('8198', '2', '1、在流量统计页查询当天设备编号4113171200100204的流量\n2、在我的设备列表页查询设备编号4113171200100204，点击刷新设备详情\n3、过段时间再次刷新设备详情', '1、写库，当天开始、结束流量均为0\n2、覆盖数据，开始、结束流量均写为刷新设备详情时的（上行+下行流量之和）\n3、开始流量不变，结束流量写为刷新设备详情时的（上行+下行流量之和）', '1', '1');
INSERT INTO `tcsteps` VALUES ('8201', '1', '汇总方式--按天汇总，选择日期为最近10日，输入设备编号4113171200100204，点击查询', '1、四个字段的值显示正确\n当前设备日总流量=昨天消耗的流量\n当前设备日均流量=昨天消耗的流量/24（每小时流量）\n当前设备月总流量=当月截止到昨天消耗的总流量\n当前设备月均流量=当月截止到昨天消耗的总流量/当月截止到昨天有消耗的天数\n2、折线图显示正确', '1', '1');
