INSERT INTO `tcsteps` VALUES ('8233', '1', '重新连接或重启设备', '表dm_device_location数据逻辑：\n用mysql的函数inet_aton将device_ip转换为int，参考dm_map_data表(device_ip在minip和maxip之间)，得出该device_ip所属洲、地区编码、国家、具体省市、经纬度存入dm_device_location表中。返回给前端。在地图上精确的展示出来。\n1、如果dm_device_location表不存在设备记录，则新增记录。\n2、如果dm_device_location表已存在设备记录，则获取设备当前连接的最新ip，ppcp根据device_ip参考dm_map_data表更新dm_device_location表', '1', '1');
INSERT INTO `tcsteps` VALUES ('8234', '2', '设备一直连接，或从未连接过', '不会写表dm_device_location', '1', '1');
INSERT INTO `tcsteps` VALUES ('8237', '1', '下拉选择或输入服务商名称，点击查询', '显示当前服务商的全部在线设备数量，地图上所有设备分布情况', '1', '1');
INSERT INTO `tcsteps` VALUES ('8240', '1', '输入设备编号名称，点击查询', '显示该设备的在线情况，地图上该设备分布情况。', '1', '1');
INSERT INTO `tcsteps` VALUES ('8241', '2', '设备编号不存在', '显示该设备的在线情况：在线设备0台，地图上该设备分布情况：无。', '1', '1');
INSERT INTO `tcsteps` VALUES ('8242', '3', '设备未销售', '', '1', '1');
INSERT INTO `tcsteps` VALUES ('8243', '4', '设备未连接', '1、设备从未连接过，显示该设备的在线情况：在线设备0台，地图上该设备分布情况：无。\n2、设备曾经连接过，现在断开。显示该设备的在线情况：在线设备0台，地图上该设备分布情况：正常显示其所在城市。', '1', '1');
INSERT INTO `tcsteps` VALUES ('8244', '5', '设备已连接', '显示该设备的在线情况：在线设备1台，地图上该设备分布情况：正常显示其所在城市。', '1', '1');
