INSERT INTO `tcsteps` VALUES ('8253', '1', '1、设备连接(ip为北京ip)\n2、修改dm_device_location表的device_ip为其他省市ip\n3、重启设备(位置北京)\n4、在地图标记页面，根据设备编号进行查询', '1、根据device_ip参考dm_map_data表更新dm_device_location表的字段city=北京市及其他字段。\n2、地图上该设备分布情况：北京市，数量1', '1', '1');
