INSERT INTO `tcsteps` VALUES ('9619', '4', '<p>点击设备验证界面的【验证】</p>\r\n', '<p>1.设备处于其他服务商时弹出防切提示</p>\r\n\r\n<p>2.设备处于未销售状态，弹出提示：customer not exite</p>\r\n\r\n<p>3.设备处于改服务商，验证成功，插件自动启动</p>\r\n\r\n<p>4.盒子灯灭，处于扫码关闭状态</p>\r\n', '1', '1');
