INSERT INTO `tcsteps` VALUES ('10586', '1', '功能同设备汇总的设备编号查询', '金额查询结果和笔数查询结果的图表显示信息与查询条件相符', '1', '1');
INSERT INTO `tcsteps` VALUES ('10589', '1', '点击账单图表', '图表上方显示当前商户所支付使用的支付方式', '1', '1');
