INSERT INTO `tcsteps` VALUES ('10593', '1', '登录权限管理平台，新建退款管理员角色，并赋权SP平台上的退款相关权限', '角色新建成功', '1', '1');
INSERT INTO `tcsteps` VALUES ('10596', '1', '服务商账号登录SP平台后，点击商户用户管理，新建或修改一商户；\n添加退款管理员角色，保存；\n退出平台，使用刚刚新建成功的商户用户账号登录SP平台。', '登录SP平台成功，可见系统设置->退款密码设置模块。', '1', '1');
INSERT INTO `tcsteps` VALUES ('10599', '1', '点击系统设置->退款密码设置模块，点击设置密码；\n准确输入密码、确认密码，保存。', '退款密码设置成功', '1', '1');
INSERT INTO `tcsteps` VALUES ('10602', '1', '首次设置密码成功后，描述界面', '修改记录、最近修改时间正确显示', '1', '1');
INSERT INTO `tcsteps` VALUES ('10605', '1', '点击系统设置->退款密码设置模块，点击修改密码；\n准确输入原密码、新密码、确认密码，保存。', '退款密码修改成功', '1', '1');
INSERT INTO `tcsteps` VALUES ('10608', '1', '点击账单管理->支付明细，点击一已完成订单，点击退款按钮', '提示输入退款密码', '1', '1');
INSERT INTO `tcsteps` VALUES ('10609', '2', '输入空密码、错误密码', '提示密码不能为空、密码错误', '1', '1');
INSERT INTO `tcsteps` VALUES ('10610', '3', '输入正确密码', '订单退款成功', '1', '1');
INSERT INTO `tcsteps` VALUES ('10613', '1', '点击账单管理->支付明细，点击一已完成订单，点击退款按钮', '提示本店未设置退款密码，无法退款，已经“前往设置”、“取消”按钮。', '1', '1');
INSERT INTO `tcsteps` VALUES ('10616', '1', '点击账单管理->支付明细，点击一已完成订单，点击退款按钮', '提示本店未设置退款密码，无法退款。', '1', '1');
