INSERT INTO `tcsteps` VALUES ('10624', '2', '设备配置无，接口配置有', '支付成功。', '1', '1');
INSERT INTO `tcsteps` VALUES ('10625', '3', '前提：成功配置设备绑定服务商的接口配置、设备配置，付款方（包含但不限于付款码+支付密码+网络等可正常使用）', '', '1', '1');
INSERT INTO `tcsteps` VALUES ('10626', '4', '自身绑定的商户（或门店）支付配置有', '支付成功。', '1', '1');
INSERT INTO `tcsteps` VALUES ('10627', '5', '自身绑定的商户（或门店）支付配置无，但上级的商户有支付配置', '支付成功。', '1', '1');
INSERT INTO `tcsteps` VALUES ('10628', '6', '自身绑定的商户（或门店）支付配置无，而且上级的商户无支付配置', '支付失败。', '1', '1');
INSERT INTO `tcsteps` VALUES ('10631', '1', '*完成付款设备，及其绑定的商户（或门店）的支付相关配置；\n使用商户名下设备支付一笔订单，使用过期的付款码，描述现象。', '支付失败。', '1', '1');
INSERT INTO `tcsteps` VALUES ('10634', '1', '*完成付款设备，及其绑定的商户（或门店）的支付相关配置；\n使用商户名下设备支付一笔订单，使用重复的付款码，描述现象。', '支付失败。', '1', '1');
INSERT INTO `tcsteps` VALUES ('10637', '1', '完成付款设备，及其绑定的商户（或门店）的支付相关配置；\n使用商户名下设备成功支付一笔订单；\n该服务商账号登录SP平台，点击账单管理->支付明细，描述刚刚生成的支付明细。', '商户名称、别名、设备编号、流水号、订单号、时间、支付明细（支付通道、支付方式、交易类型：被扫）、金额明细（应付金额、实付金额、实收金额）、状态等项正常显示。', '1', '1');
INSERT INTO `tcsteps` VALUES ('10640', '1', '', '', '1', '1');
INSERT INTO `tcsteps` VALUES ('10643', '1', '完成付款设备，及其绑定的商户（或门店）的支付相关配置；\n使用商户名下设备支付一笔订单，延迟输入支付密码的时间，描述现象。', '支付失败，撤单成功。', '1', '1');
INSERT INTO `tcsteps` VALUES ('10646', '1', '完成付款设备，及其绑定的商户（或门店）的支付相关配置；\n使用商户名下设备支付一笔订单，获取设备的付款二维码，扫描二维码，描述现象。', '支付成功，主扫功能正常。', '1', '1');
INSERT INTO `tcsteps` VALUES ('10649', '1', '完成付款设备，及其绑定的商户（或门店）的支付相关配置；\n使用商户名下设备支付一笔订单，获取设备的付款二维码，多次扫描二维码，描述现象。', '提示付款码已过期。', '1', '1');
INSERT INTO `tcsteps` VALUES ('10652', '1', '完成付款设备，及其绑定的商户（或门店）的支付相关配置；\n使用商户名下设备主扫功能，成功支付一笔订单；\n该服务商账号登录SP平台，点击账单管理->支付明细，描述刚刚生成的支付明细。', '商户名称、别名、设备编号、流水号、订单号、时间、支付明细（支付通道、支付方式、交易类型：主扫）、金额明细（应付金额、实付金额、实收金额）、状态等项正常显示。', '1', '1');
INSERT INTO `tcsteps` VALUES ('10655', '1', '', '', '1', '1');
INSERT INTO `tcsteps` VALUES ('10658', '1', '完成付款设备，及其绑定的商户（或门店）的支付相关配置；\n使用商户名下设备主扫功能，支付一笔订单，延迟输入支付密码的时间，描述现象。', '支付失败，撤单成功。', '1', '1');
INSERT INTO `tcsteps` VALUES ('10661', '1', '完成付款设备，及其绑定的商户（或门店）的支付相关配置；\n使用商户名下设备支付一笔订单（如0.01元），使用付款码，成功支付；\n设置退款金额0.01，付款设备识别刚刚支付成功的订单号，描述现象。', '成功退款。\n（交易日期超30天的订单无法退款）', '1', '1');
INSERT INTO `tcsteps` VALUES ('10664', '1', '完成付款设备，及其绑定的商户（或门店）的支付相关配置；\n使用商户名下设备支付一笔订单（如0.02元），使用付款码，成功支付；\n设置退款金额0.01，付款设备识别刚刚支付成功的订单号，描述现象；\n再次设置退款金额0.01，付款设备再次识别刚刚支付成功的订单号，描述现象；\n再次设置退款金额0.01，付款设备再次识别刚刚支付成功的订单号，描述现象。', '1.分批退款成功。\n2.退款失败，金额已全部退款。', '1', '1');
INSERT INTO `tcsteps` VALUES ('10667', '1', '该服务商账号登录SP平台，点击账单管理->支付明细，选中刚刚生成的支付明细记录；\n点击右方状态下（全部退款），描述界面。', '进入该订单退款详情界面，订单号、退款订单号、支付流水号、设备编号、别名、商户名称、退款时间、退款明细（退款金额、支付方式、交易类型、支付通道）正常显示。', '1', '1');
INSERT INTO `tcsteps` VALUES ('10670', '1', '该服务商账号登录SP平台，点击账单管理->退款明细，描述刚刚生成的退款明细。', '商户名称、别名、设备编号、支付流水号、订单号、退款时间、退款明细（退款金额、支付方式、交易类型、支付通道）等项正常显示。', '1', '1');
INSERT INTO `tcsteps` VALUES ('10673', '1', '一家商户的不同门店之间（支付配置一样）退款\n付款方在门店A下设备成功支付一笔订单，随后在门店B下设备进行退款操作，描述现象。', '退款失败。', '1', '1');
INSERT INTO `tcsteps` VALUES ('10676', '1', '一家门店的不同设备之间（支付配置一样）退款\n付款方在门店A下设备1成功支付一笔订单，随后在门店A下另一设备2进行退款操作，描述现象。', '退款成功。', '1', '1');
INSERT INTO `tcsteps` VALUES ('10679', '1', '一家门店的不同设备之间（支付配置一样）退款\n付款方在门店A下设备1成功支付一笔订单如P283247793382470656，订单金额0.01，随后在门店A下另一设备3进行退款操作（全部退款）；\n进入SP->支付汇总界面，输入设备1，订单号P283247793382470656，查询描述现象。\n输入设备3，订单号P283247793382470656，查询描述现象。\n', '1.显示设备1的支付明细，该笔订单已成功退款。\n2.查询为空。', '1', '1');
INSERT INTO `tcsteps` VALUES ('10682', '1', '一家门店的不同设备之间（支付配置一样）退款\n付款方在门店A下设备1成功支付一笔订单如P283247793382470656，订单金额0.01，随后在门店A下另一设备3进行退款操作（全部退款）；\n进入SP->退款界面，输入订单号P283247793382470656，查询描述现象。', '显示该笔订单的退款明细，退款设备编号为设备3。', '1', '1');
INSERT INTO `tcsteps` VALUES ('10685', '1', '付款方式使用设备1在A门店成功支付一笔订单如P290653767428366464，随后设备1从A门店下解绑，再次销售到B门店；\n付款方使用设备1进行退款操作，描述现象。', '退款失败。', '1', '1');
