INSERT INTO `tcsteps` VALUES ('10920', '1', '<p>1. 点击已销售设备标签</p>\r\n\r\n<p>2. 点击展开商户树</p>\r\n\r\n<p>3. 点击商户&ldquo;已销售设备测试1&rdquo;</p>\r\n\r\n<p>4. 点击设备绑定按钮</p>\r\n\r\n<p>5. 查询要绑定的设备</p>\r\n\r\n<p>6. 选中设备，点击确认绑定按钮</p>\r\n\r\n<p>7. 点击确定按钮</p>\r\n', '<p>1. 提示消息: 已成功绑定1台设备</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('10921', '2', '<p>解绑设备</p>\r\n\r\n<p>1. 在设备管理已销售设备页选择要解绑的设备</p>\r\n\r\n<p>2. 点击设备解绑按钮</p>\r\n\r\n<p>3. 点击确定按钮</p>\r\n', '<p>1. 提示消息: 设备解绑成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('10924', '1', '<p>1. 点击已销售设备标签</p>\r\n\r\n<p>2. 设备编号输框输入要操作的设备编号</p>\r\n\r\n<p>3. 点击修改别名图标</p>\r\n\r\n<p>4. 点击取消按钮</p>\r\n\r\n<p>5. 点击修改别名图标</p>\r\n\r\n<p>6. 别名输入框：别名测试</p>\r\n\r\n<p>7. 点击确定按钮</p>\r\n', '<p>1. 提示消息: 别名编辑成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('10927', '1', '<p>添加二级服务商用户</p>\r\n\r\n<p>1. SP平台登录服务商账户后打开商户用户管理</p>\r\n\r\n<p>2. 点击添加用户按钮</p>\r\n\r\n<p>3. 点击返回按钮</p>\r\n\r\n<p>4. 点击添加用户按钮</p>\r\n\r\n<p>5. 用户名输入框：ejf_user</p>\r\n\r\n<p>6. 所属商户下拉列表：选择二级服务商for新增用户测试</p>\r\n\r\n<p>7. 角色下拉列表：选择&ldquo;二级服务商&rdquo;</p>\r\n\r\n<p>8. 密码输入框：123456</p>\r\n\r\n<p>9. 确认密码输入框：123456</p>\r\n\r\n<p>10. 点击保存按钮</p>\r\n', '<p>1. 提示消息: 已成功添加用户</p>\r\n', '1', '2');
