INSERT INTO `tcsteps` VALUES ('11300', '1', '<p>插件停止状态，在软件设置的收款设置界面点击【支付方式设置】</p>\r\n', '<p>打开支付方式设置界面</p>\r\n\r\n<p>默认支付方式为：微信/支付宝/银联二维码/QQ钱包/百度钱包/和包/翼支付</p>\r\n\r\n<p>且以上支付方式默认全勾选</p>\r\n\r\n<p>交接班和交易汇总中显示的支付方式与以上方式一致</p>\r\n', '1', '1');
