INSERT INTO `tcsteps` VALUES ('11661', '2', '<p>1. 在未销售列表中销售一台设备</p>\r\n\r\n<p>2. 查询第1步销售的设备</p>\r\n', '<p>1. 查询结果：listcount值为0</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('11662', '2', '<p>服务商名称单独与结合设备号查询</p>\r\n\r\n<p>1. 进入我的设备页</p>\r\n\r\n<p>2. 选择服务商&ldquo;test_设备管理查询&rdquo;</p>\r\n\r\n<p>3. 输入设备号</p>\r\n\r\n<p>4. 点击查询</p>\r\n', '<p>1. 查询结果中不包含&ldquo;test_设备管理查询&rdquo;服务商之外的服务商设备</p>\r\n\r\n<p>2. 服务商+设备号查询结果为：listcount值为1</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('11663', '3', '<p>产品类型查询</p>\r\n\r\n<p>1. 进入我的设备页</p>\r\n\r\n<p>2. 产品类型选择&ldquo;国际版&rdquo;</p>\r\n', '<p>1.查询结果列表中不包括[&#39;条码扫描设备&#39;, &#39;Inspos系列&#39;, &#39;专销产品&#39;, &#39;配件&#39;]</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('11664', '4', '<p>设备类型查询</p>\r\n\r\n<p>1. 进入我的设备页</p>\r\n\r\n<p>2. 设备类型选择&ldquo;RC&rdquo;</p>\r\n', '<p>查询结果列表中不包括[&#39;加强版&#39;, &#39;基础版&#39;, &#39;兼容版&#39;, &#39;闪票小盒&#39;, &#39;外设产品&#39;, &#39;公交扫码设备&#39;]</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('11665', '5', '<p>连接状态查询</p>\r\n\r\n<p>1. 进入我的设备页</p>\r\n\r\n<p>2. 连接状态选择&ldquo;已连接&rdquo;</p>\r\n', '<p>查询结果列表中不包括[&#39;未连接&#39;]</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('11668', '1', '<p>连接A6，安装Landi驱动</p>\r\n', '<p>1.驱动安装成功，弹出可以正常使用提示</p>\r\n\r\n<p>2.插件弹出更换设备需要重新激活提示</p>\r\n', '1', '1');
INSERT INTO `tcsteps` VALUES ('11669', '2', '<p>在商户信息界面激活A6设备，启动客户端扫码支付</p>\r\n', '<p>1.激活时获取ID和设备类型正确，激活成功，客户端启动成功</p>\r\n\r\n<p>2.扫码弹窗</p>\r\n\r\n<p>3.支付成功/失败报语音</p>\r\n\r\n<p>4.通过非扫码的方式调出收款界面播报下发的语音</p>\r\n', '1', '1');
INSERT INTO `tcsteps` VALUES ('11672', '1', '<p>使用新版客户端覆盖安装后，删除config文件夹下的BPconfig文件和token文件，连接A6，安装驱动，启动客户端至激活界面</p>\r\n', '<p>ID栏获取到ID</p>\r\n', '1', '1');
INSERT INTO `tcsteps` VALUES ('11673', '2', '<p>激活并启动插件，扫码支付</p>\r\n', '<p>1.插件启动成功</p>\r\n\r\n<p>2.扫码弹窗</p>\r\n\r\n<p>3.支付成功/失败报语音</p>\r\n', '1', '1');
INSERT INTO `tcsteps` VALUES ('11682', '1', '1. 登陆用户testsh查看商户名称', '商户名称显示为“商户简称”，超长字符打点处理。', '1', '1');
INSERT INTO `tcsteps` VALUES ('11685', '1', '1. 通过平台修改商户信息\n2. 查看APP获取的商户信息', '登陆后APP获取的商户信息与平台一致', '1', '1');
