INSERT INTO `tcsteps` VALUES ('11691', '1', '1.商户登陆成功后，查看首页', '商户名称、今日实收（含币种信息）、收入（含币种信息）、退款（含币种信息）显示正常，若下拉刷新，数据更新正常\n门店查询、统计数据、账单查询、更多设置四个入口显示正常，可正常点击使用', '1', '1');
INSERT INTO `tcsteps` VALUES ('11694', '1', '1. 通过平台配置该商户下各门店的支付配置，分别选择不同的币种，成功支付一笔或一笔以上的订单\n2. 商户角色登陆app，查看商户首页的币种类型', '默认显示该商户名下门店成功订单包含的一种币种，如果含N种币种，可以下拉选择币种类型\n', '1', '1');
INSERT INTO `tcsteps` VALUES ('11697', '1', '1. 商户下各门店的设备进行支付款', '1.商户角色开始登陆app，首页统计数据实时刷新\n2.商户角色登陆app一段时间后，需手动下拉刷新，统计数据更新\n3.刷新后，已选定的币种不变', '1', '1');
