INSERT INTO `tcsteps` VALUES ('11891', '1', '金额卡片左右滑动\n1.收入→实收→退款滑动\n2.退款→实收→收入滑动\n3.收入→实收→收入滑动\n4.收入→实收→退款→左滑动\n5.收入→右滑动', '金额卡片可左右滑动\n1. 翻页顺序收入→实收→退款\n2. 翻页顺序退款→实收→收入\n3. 翻页顺序收入→实收→收入\n4. 翻页顺序收入→实收→退款→不能左滑动\n5. 翻页顺序收入→不能右滑动', '1', '1');
