INSERT INTO `tcsteps` VALUES ('11897', '1', '金额占比显示-收入', '1.金额占比上方显示当天的收入金额之和；\n2.支付方式后显示该支付方式当天的收入金额之和；\n3.支付方式，按照首字母排序，占比颜色\n4.没有交易的支付方式也需要显示，显示金额为0.00', '1', '1');
INSERT INTO `tcsteps` VALUES ('11900', '1', '笔数占比显示-收入', '1.笔数占比上方显示当天的收入笔数之和；\n2.支付方式后显示该支付方式当天的收入笔数之和；\n3.支付方式，按照首字母排序；\n4.没有交易的支付方式也需要显示，显示笔数为0', '1', '1');
