INSERT INTO `tcsteps` VALUES ('11921', '1', '时间控件-点击“今日”，点击确认', '1.“今日”当天的数据，下方时间联动为当天，从00:00点到当前时间；\n2.搜索结果正确', '1', '1');
INSERT INTO `tcsteps` VALUES ('11924', '1', '时间控件-点击“本周”，点击确认\n1.今日周日\n2.今日周一\n3.今日周五\n4.今日周六', '“本周”是本周的数据，下方时间联动为本周，从周日00:00点到周六23:59:59秒。\n1.从周日00:00点到周日当前时间，搜索结果正确；\n2.从周日00:00点到周一当前时间，搜索结果正确；\n3.从周日00:00点到周五当前时间，搜索结果正确；\n4.从周日00:00点到周六当前时间，搜索结果正确', '1', '1');
INSERT INTO `tcsteps` VALUES ('11927', '1', '时间控件-点击“本月”，点击确认', '1.“本月”是当月的数据，从本月第一天00:00点到本月末（最后一天）23:59:59秒（如今日5号，点击【本月】从本月第一天00:00点到5号当前时间）；\n2.搜索结果正确', '1', '1');
INSERT INTO `tcsteps` VALUES ('11930', '1', '时间控件-自定义\n1.结束时间小于开始时间；\n2.开始时间、结束时间选择未来时间；\n3.开始时间设定好后，查看结束时间\n4.开始时间、结束时间的间隔大于31天\n5.开始时间最早可选择的时间', '1.结束时间不能小于开始时间；\n2.开始时间、结束时间最大只可以选到当前时间，不可选未来时间；\n3.结束时间自动匹配31天之后的时间点；\n4.提示“最长查询期间31天”\n5.开始时间最早可选择的时间为当前门店下最早一笔订单的创建时间', '1', '1');
