INSERT INTO `tcsteps` VALUES ('13043', '1', '1.键盘输入F1+000+0，按确认键\n2.扫微信的付款码', '1.固定金额设置成功，键盘和立扫屏幕显示0.00，语音播报金额\n2.扫码支付时键盘显示待支付', '1', '1');
INSERT INTO `tcsteps` VALUES ('13046', '1', '1.键盘输入F1+000+0.00，按确认键\n2.扫微信的付款码', '1.固定金额设置成功，键盘和立扫屏幕显示0.00，语音播报金额\n2.扫码支付时键盘显示待支付', '1', '1');
INSERT INTO `tcsteps` VALUES ('13049', '1', '1.键盘输入F1+000+2\n2.按退格键，再输入2\n3.按确认键', '1.固定金额设置成功，键盘和立扫屏幕显示2.00，语音播报金额', '1', '1');
INSERT INTO `tcsteps` VALUES ('13052', '1', '1.键盘输入F1+000+22\n2.按确认键\n3.按清除键', '1.固定金额设置成功，键盘和立扫屏幕显示22.00，语音播报金额', '1', '1');
INSERT INTO `tcsteps` VALUES ('13064', '1', '见‘模拟网络环境专项测试’用例表格', '在不同网络下各项试项均正常', '1', '1');
INSERT INTO `tcsteps` VALUES ('13067', '1', '1.长时间工作，如3周（24hX21d），查看模块能否正常工作\n2.期间偶尔将设备连接的网络断开，之后将网络恢复\n3.期间偶尔将键盘、打印机插拔', '1.设备工作正常，每天早中晚支付退款几次均正常\n2.设备能够自动恢复连网\n3.盒子无异常，键盘、打印机工作正常', '1', '1');
INSERT INTO `tcsteps` VALUES ('13070', '1', '1.通过什么操作使内存占满', '1.内存自动释放，设备无异常现象', '1', '1');
INSERT INTO `tcsteps` VALUES ('13073', '1', '1.配LAN一次，配WIFI一次，循环测试50次，统计成功率', '1.统计成功率（不低于98%？）', '1', '1');
INSERT INTO `tcsteps` VALUES ('13076', '1', '1.从当前测试版本向其它版本升级20次', '1.统计成功率', '1', '1');
INSERT INTO `tcsteps` VALUES ('13079', '1', '1.通过设备发送支付请求500次，持续发送，通过日志查看设备发送请求成功率\n2.通过设备发送支付请求500次，间隔1分钟发送，通过日志查看设备发送请求成功率', '1.统计成功率', '1', '1');
INSERT INTO `tcsteps` VALUES ('13082', '1', '1.通过不同方式连网，每种连网方式各测20次，对比网络连接时间（从配网成功到设备灯变为绿色）\n2.通过不同方式连网，每种连网方式各测20次，对比支付成功时间（从扫码至播报支付成功的时间）', '1.记录连网时间\n2.记录支付时间', '1', '1');
INSERT INTO `tcsteps` VALUES ('13085', '1', '1.将设备与所连路由经墙隔开，路由器分别设置穿墙模式和非穿墙模式', '1.设备能正常工作', '1', '1');
INSERT INTO `tcsteps` VALUES ('13088', '1', '1.盒子所连路由附近有多台路由（具体几台根据实际情况进行确定）', '1.盒子工作正常', '1', '1');
INSERT INTO `tcsteps` VALUES ('13091', '1', '1.支付码放在盒子上连续扫一晚上（时间可根据实际情况进行调整），第二天测试支付、升级', '1.能支付、升级成功', '1', '1');
INSERT INTO `tcsteps` VALUES ('13097', '1', '1.将设备所连路由外网断开，设备检测到连接断开后立刻将网络恢复', '1.盒子能够重连网络成功，支付退款成功', '1', '1');
INSERT INTO `tcsteps` VALUES ('13100', '1', '1.将设备所连路由外网断开，设备检测到连接断开1分钟时将网络恢复', '1.盒子能够重连网络成功，支付退款成功', '1', '1');
INSERT INTO `tcsteps` VALUES ('13103', '1', '1.将设备所连路由外网断开，设备检测到连接断开3分钟时将网络恢复', '1.盒子能够重连网络成功，支付退款成功', '1', '1');
INSERT INTO `tcsteps` VALUES ('13106', '1', '1.将设备所连路由外网断开，设备检测到连接断开10分钟时将网络恢复', '1.盒子能够重连网络成功，支付退款成功', '1', '1');
INSERT INTO `tcsteps` VALUES ('13109', '1', '1.同一网络下反复断网再连接（20次）', '1.盒子能够重连网络成功且盒子无异常现象', '1', '1');
INSERT INTO `tcsteps` VALUES ('13112', '1', '1.将设备所连路由器断电，设备检测到连接断开后将路由器恢复', '1.盒子能够重连网络成功，支付退款成功', '1', '1');
INSERT INTO `tcsteps` VALUES ('13115', '1', '1.将设备远离所配WIFI的信号覆盖范围\n2.将设备重新放置WIFI信号范围', '1.设备闪烁红光，即状态为断网现象\n2.盒子恢复连网，支付退款成功', '1', '1');
