INSERT INTO `tcsteps` VALUES ('13848', '1', '<p>1. 点击支付配置管理标签</p>\r\n\r\n<p>2. 点击支付配置管理二级标签</p>\r\n\r\n<p>3. 点击新增按钮</p>\r\n\r\n<p>4. 配置名称输入框：支付票据打印配置</p>\r\n\r\n<p>5. 配置类型选择支付</p>\r\n\r\n<p>6. 点击增加字段图标</p>\r\n\r\n<p>7. 字段key分别选择：&#39;orderNo&#39;, &#39;transactionId&#39;, &#39;time&#39;, &#39;totalFee&#39;, &#39;payFee&#39;, &#39;discountFee&#39;, &#39;deviceNo&#39;, &#39;payType&#39;, &#39;customerName&#39;</p>\r\n\r\n<p>8. 字段value分别填写：&#39;orderNo&#39;, &#39;transactionId&#39;, &#39;time&#39;, &#39;totalFee&#39;, &#39;payFee&#39;, &#39;discountFee&#39;, &#39;deviceNo&#39;, &#39;payType&#39;, &#39;customerName&#39;</p>\r\n\r\n<p>9. 点击保存按钮</p>\r\n', '<p>1. 提示：添加成功</p>\r\n', '1', '2');
INSERT INTO `tcsteps` VALUES ('13849', '2', '<p>1. 点击支付配置管理标签</p>\r\n\r\n<p>2. 点击支付配置管理二级标签</p>\r\n\r\n<p>3. 点击新增按钮</p>\r\n\r\n<p>4. 配置名称输入框：退款票据打印配置</p>\r\n\r\n<p>5. 配置类型选择退款</p>\r\n\r\n<p>6. 点击增加字段图标</p>\r\n\r\n<p>7. 字段key分别选择：&#39;orderNo&#39;, &#39;transactionId&#39;, &#39;time&#39;, &#39;totalFee&#39;, &#39;payFee&#39;, &#39;discountFee&#39;, &#39;deviceNo&#39;, &#39;payType&#39;, &#39;customerName&#39;, &#39;refundFee&#39;, &#39;refundNo&#39;</p>\r\n\r\n<p>8. 字段value分别填写：&#39;orderNo&#39;, &#39;transactionId&#39;, &#39;time&#39;, &#39;totalFee&#39;, &#39;payFee&#39;, &#39;discountFee&#39;, &#39;deviceNo&#39;, &#39;payType&#39;, &#39;customerName&#39;, &#39;第11行value选择refundFee&#39;, &#39;第12行value选择refundNo&#39;</p>\r\n\r\n<p>9. 点击保存按钮</p>\r\n', '<p>1. 提示：添加成功</p>\r\n', '1', '2');
